(1166, 18, 0, 3, '1165', 'Nestle Ceregrow Multigrain With Milk & Fruits Junior Cereal (2-5 years)', '600.00', 'Nestlé CEREGROW is a nutrient dense junior cereal with the goodness of multigrain, milk and fruits. Ideal for infants from 2 to 5 year olds, this is dense nutrition for small tummies. Use CEREGROW along with a varied, balanced diet and healthy lifestyle of your 2-5 year old.\r\nCEREGROW™ is a rich source of Iron that helps in regular cognitive development and contains Vitamin A, C, and D, and Calcium for growth and development. It is high in Protein and also a source of 17 vitamins and minerals. It is free from preservatives and flavours, especially made for your little one.\r\nRecommended Serving: Serve 1 bowl a day.', '554.00', '471.00', 1, '2020-07-18 14:39:37', '2020-07-18 14:39:37', NULL),
