(1180, 10, 0, 2, '1178', 'Dhara Refined - Sunflower Oil, 1 L Pouch', '1.00', 'Dhara Health Refined Sunflower Oil comes with the goodness of unique Low Absorb Technology which means that the food cooked in it absorbs less oil. It also contains the goodness of Vitamin A, D & E. Dhara Health is a good source of polyunsaturated fatty acid (PUFA) and contains high amount of Omega 6, the Essential Fatty Acid (EFA) which cannot be synthesized in the body and has to be consumed from external sources.', '140.00', '113.00', 1, '2020-07-20 12:13:03', '2020-08-21 19:57:12', NULL),
(1181, 10, 0, 1, '1180', 'Pillsbury Atta - Chakki Fresh, 10 kg Pouch', '10.00', 'Rotis made from Pillsbury Chakki Fresh Atta is a healthy option for those who prefer rotis and chapattis (Indian bread) to rice. As this atta or wheat flour is known to contain three parts of the whole wheat grain, you can be assured of wholesome nourishment when you are eating rotis made from this wheat flour.', '490.00', '359.00', 1, '2020-07-20 12:23:59', '2020-09-04 20:10:34', NULL),
(1182, 10, 0, 1, '1181', 'Daawat Basmati Rice - Rozana Gold, 5 kg Pouch', '5.00', 'Daawat Rozana Gold is the finest Basmati Rice in the mid-price affordable segment. Rozana Gold has 3/4th length of the basmati grains It is specially processed for daily cooking across a multitude of regular dishes, a perfect fit for every day consumption. It promises a sweet taste and rich aroma as each grain is naturally aged.', '495.00', '399.00', 1, '2020-07-20 12:26:10', '2020-07-20 12:26:10', NULL),
(1183, 10, 0, 3, '1182', 'Everest Powder - Turmeric,', '200.00', 'Turmeric Powder is one along with those spices to be proved as a best result of Everest. The part of Turmeric powder is very much necessary to make our eating stuffs or dishes scented and colored. Turmeric has a soft, earthy and woody aroma. It stimulates protein digestion, and is a superb blood purifier. It is a accepted variety in India, where turmeric is used as a solution coloring agent in \'curries\'.', '56.00', '50.00', 1, '2020-07-20 12:28:49', '2020-09-04 20:44:24', NULL),
(1184, 10, 0, 3, '1183', 'Everest Tikhalal Chilli Powder', '500.00', 'The spicy taste of Indian food can be likened with the Paprika bearing Mexican cuisine that sets your palate on appetising fire! Everest is a brand that has been well known for qualitative spices and spice mixes as well. This spice blend is one that brings in the fiery magic of red chillies, well known in India!', '185.00', '117.00', 1, '2020-07-20 12:30:34', '2020-07-20 12:30:34', NULL),
(1185, 10, 0, 3, '1184', 'Everest Garam Masala', '100.00', 'Everest Garam Masala has been an evergreen taste enhancer for several years in India. It is a combine of 13 spices, with chilli powder as the support zest. The masala known for adding the savor to dishes also gives thick red colour to the ever unusual Indian dishes.', '78.00', '70.00', 1, '2020-07-20 12:38:41', '2020-09-04 20:39:32', NULL),
(1186, 10, 0, 3, '1185', 'Everest Powder - Green Coriander', '200.00', 'Everest Coriander Powder is vastly used in Indian cuisine. This powder is very much desirable and it also acts as a thickening cause. It presents a humid and gentle flavor to curry dishes and acts as a thickener for gravies.', '56.00', '50.00', 1, '2020-07-20 12:40:09', '2020-09-04 20:48:01', NULL),
(1187, 10, 0, 2, '1186', 'Dhara Oil - Groundnut', '1.00', 'Dhara groundnut oil has wealthy source of saturated, polyunsaturated fatty acids and monosaturated fatty acids. It is less filtered keeping several of the groundnut proteins in order to maintain the nutrition and flavor.', '195.00', '171.00', 1, '2020-07-20 12:41:16', '2020-08-21 20:20:52', NULL),
(1188, 10, 0, 5, '1187', 'Amul High Aroma Cow Ghee', '200.00', 'Amul high aroma cow ghee is made from pure cow milk which has a rich taste and high aroma. From the house of Amul, you can blindly trust on its hygienic aspect. With full of flavours and strong aroma, cow ghee is one of the popular ingredients in many Indian dishes. \r\n\r\nAdd this high aroma cow ghee to your food and multiply the taste manifold.', '120.00', '116.00', 1, '2020-07-20 12:42:49', '2020-08-21 20:23:33', NULL),
(1189, 10, 0, 2, '1188', 'Emami Healthy & Tasty - Kachi Ghani Mustard Oil', '1.00', 'Emami Healthy & Tasty Kachchi Ghani Mustard Oil is manufactured from Select Best Quality Seeds by First Press Technology for highest purity and retention of natural pungency. This oil will reduce the risk of cancer, improves blood circulation, and invigorates digestion.', '155.00', '129.00', 1, '2020-07-20 12:50:18', '2020-08-21 20:25:05', NULL),
(1190, 10, 0, 1, '1189', 'Tata Salt Lite', '1.00', 'Tata Salt Lite is low-sodium salt from the house of Tata. The formulation of the salt is such that it provides 15% lower sodium than normal salt. Salt with lower sodium in diet helps to lower blood pressure levels. Salt is an essential ingredient in any food item as it works as an enhancer.', '40.00', '36.00', 1, '2020-07-20 12:52:29', '2020-08-21 20:26:50', NULL),
(1191, 10, 0, 2, '1190', 'Dhara Oil - Mustard (Kachi Ghani)', '1.00', 'Dhara is a brand that signifies top notch culinary products and cooking additives. Its range of products help you create gourmet worthy delights in the kitchen. With Dhara, you have a partner who supplies you with the purest of ingredients, and its Kachi Ghani Mustard Oil is one of these products.', '150.00', '135.00', 1, '2020-07-20 12:54:12', '2020-09-04 19:45:34', NULL),
(1192, 10, 0, 1, '1191', 'Tata Sampann Besan', '1.00', 'Every Grain Is 100-Per Cent Laser-Sorted And Graded To Ensure That Consumers Get No Impurities, Damaged Or Weevilled Grains. Indulge in the true flavours of nature with the all-natural Tata I Shakti dal. The range of Tata pulses come with a promise of superior quality and genuine flavours. Tata I Shakti pulses are cultivated in Indian farms and are grown in completely natural conditions to bring to you the purest form of health and nutrition. The Tata channa dal is free from any added chemicals, colour or any other foreign element. The unpolished I Shakti dal is not exposed to the harmful marble powder, oil polish or animal skin touch that are the base polishing elements found in polished pulses. Tata Shakti dal is power packed with nutritional essentials like protein, dietary fibre and carbohydrates. Buy Tata channa dal and take a step ahead towards a healthier lifestyle.', '115.00', '100.00', 1, '2020-07-20 12:57:56', '2020-09-04 20:11:32', NULL),
(1193, 10, 0, 2, '1192', 'Amul Pure Ghee', '1.00', 'Clarified Butter or Pure Ghee is a staple in Indian Kitchens. Known to be rich in antioxidants and trans fat, this product from the house of Amul can be used for cooking and aids people in the weight management process as well. Amul is well known for its wide range of high-quality dairy products.', '500.00', '450.00', 1, '2020-07-20 13:09:29', '2020-08-21 20:53:03', NULL),
(1194, 10, 0, 2, '1193', 'Emami Healthy & Tasty - Refined Sunflower Oil', '1.00', 'Emami Healthy & Tasty Sunflower Oil is manufactured with Multistage European Refining Technology for highest purity and retention of natural nutrients. This amazing oil contains vitamins and anti-oxidants, which will help your skin and hair. Also, it will lower cholesterol, reduce acne, and reduce the risk of cardiovascular disease.', '130.00', '110.00', 1, '2020-07-20 13:12:24', '2020-07-20 13:12:24', NULL),
(1195, 10, 0, 3, '1194', 'Everest Powder - Cumin', '100.00', 'Sourced from the well drained, loamy regions of Gujarat and Rajasthan. This type is much valued for its high percentage of essential oil content that gives it an intense flavor.\r\nCumin seeds has a penetrating musty, earthy flavor. Its a cooling spice. In the middle ages, cumin was believed to keep lovers faithful and chicken from straying. More recently, cumin has become popular because of its use in Mexican cooking.\r\nA native of Egypt and the Mediterranean, cumin is now mostly produced in India. Gujarat, Rajasthan and Uttar Pradesh are the prominent producers.', '51.00', '51.00', 1, '2020-07-20 13:15:34', '2020-07-20 13:15:34', NULL),
(1196, 10, 0, 1, '1195', 'Aashirvaad Salt - Iodised', '1.00', 'Ashirvaad Iodized Salt is acquired by evaporating brine or salt water in low basins by wind and sunlight. It is the spirit of all life, enabling excellent fitness and health. It is good that goes into all set of Aashirvaad Iodized salty.', '20.00', '19.00', 1, '2020-07-20 13:18:37', '2020-07-20 13:18:37', NULL),
(1197, 10, 0, 2, '1196', 'Amul Cow Ghee', '1.00', 'Ideal for Cooking, Garnishing and Making Sweets.', '500.00', '465.00', 1, '2020-07-20 13:20:44', '2020-09-04 19:57:33', NULL),
(1198, 10, 0, 1, '1197', 'Daawat Basmati Rice - Super', '1.25', 'Versatile, fine, long-grained and perfectly textured. Â Basmati rice fit for a King. Daawat Super is aged to perfection.', '165.00', '138.00', 1, '2020-07-20 13:41:02', '2020-07-20 13:41:02', NULL);
