(1199, 10, 0, 3, '1198', 'Everest Powder - Black Pepper', '50.00', 'Fine ground and really aromatic Everest Black Pepper Powder is well-known for its exceptional flavor. It has a hot taste and spicy. These \'bold\' berried peppers are sourcing from the last shipping port Alleppey a Southern district of Kerala. It is moreover one of the oldest and essential spices across the world.', '80.00', '80.00', 1, '2020-07-20 13:42:19', '2020-07-20 13:42:19', NULL),
(1200, 10, 0, 1, '1199', 'Pillsbury Atta - Multigrain', '5.00', 'Multigrain Atta from Pillsbury is a first-of-its-kind, an exclusive blend of seven grains that are especially blended to supply all-around fitness benefits. It is also a key part in certain type of snacks like halwa. Pillsbury Multigrain Atta promises your family additional nutrition each day.', '310.00', '298.00', 1, '2020-07-20 13:43:46', '2020-07-20 13:43:46', NULL),
(1201, 10, 0, 3, '1200', 'Everest Chicken Masala', '50.00', 'Everest Masala - Chicken this blend, the flavoring agents slightly predominate the flavor elements. Consequently the blend is fewer steeped in spiciness. For chicken curry, this gives the correct balance between the other ingredients and spice-elements in the dish.', '38.00', '34.00', 1, '2020-07-20 13:45:18', '2020-09-04 20:49:39', NULL),
(1202, 10, 0, 3, '1201', 'Mdh Powder - Amchoor,', '100.00', 'MDH has been in the taste making business for generations now. It brings together traditional and authentic Indian spices and packages them in powdered form or as spice mixes to ensure that your kitchen always has a delicious scent of home cooked food wafting out of it. The Amchoor Powder by MDH is one of its high quality products.', '82.00', '78.00', 1, '2020-07-20 13:47:49', '2020-08-21 21:38:50', NULL),
(1203, 10, 0, 3, '1202', 'Mdh Chunky Chat masala', '100.00', 'MDH Chunky Chat Masala is spice mix for salads. Chat Masala is a necessary seasoning in Indian cuisine. This alluring tart, spicy, peppery and salty mix of spices is used to improve the flavor of all from fruits to flavorful snacks. It is a blend of salt, black salt, cumin, dry mango powder, pomegranate seeds, coriander, black pepper, nutmeg, mint leaves and extra spices.', '63.00', '60.00', 1, '2020-07-20 13:49:41', '2020-08-21 21:44:40', NULL),
(1204, 10, 0, 3, '1203', 'Everest Hing-Asafoetida Powder - Yellow', '50.00', 'An amber colored resin extracted from the root or stem of a perennial plant, Hing plays many roles in many cultures. Scientifically called Ferula Assafoetida, Hing has been used as widely as in ancient Persia, Greece, Africa and India. From being used in black magic or warding away the evil eye to soothing stomach ailments, this spice has significant contribution to cultures around the world. But in cuisines, its pungent and strong aroma is put to good use as a replacement for onion and garlic. It gives off a smooth and robust flavor when released in hot oil. Today it is more commonly available in compounded forms', '70.00', '70.00', 1, '2020-07-20 13:51:01', '2020-07-20 13:51:01', NULL),
(1205, 10, 0, 1, '1204', 'Tata Salt Rock Salt', '1.00', 'Enjoy a fresh burst of flavour in every meal with Tata Salt Rock Salt. Sourced from the Himalayas, Tata Rock Salt brings a refreshing combination of great taste and health to your table. The pink crystals are rich in essential minerals like calcium, magnesium and potassium. You can add Tata Rock Salt to your day to day meals and even meals for special occasions. Tata Rock Salt can also be used to enhance fasting foods.', '120.00', '100.00', 1, '2020-07-20 13:52:43', '2020-09-04 21:29:36', NULL),
(1206, 10, 0, 3, '1205', 'Nutrela Soya - Chunks.', '200.00', 'Ruchi Nutrela - soy chunks are an ideal family food-rich in proteins, versatile, and easy to prepare. It is prepared from fully cooked soya bean. They contain over 50% high excellence proteins. After absorbing water, they turn supple and increase to thrice the size.', '45.00', '42.00', 1, '2020-07-20 13:54:11', '2020-08-21 21:55:21', NULL),
(1207, 10, 0, 3, '1206', 'Everest Powder - Kutilal Red Chilli', '100.00', 'Everest Kutilal Red Chilli Powder is a coarse-ground red chili powder of the premium quality, distinguished by their mild pungency and bright red colour. It is a heating spice and comes in a broad variety of sizes, colours, shapes and degrees of pungency.', '40.00', '38.00', 1, '2020-07-20 14:11:56', '2020-08-21 22:02:28', NULL),
(1208, 10, 0, 3, '1207', 'Everest Powder - Kashmirilal Ground Chilly', '100.00', 'Fine ground red chillies of the finest quality distinguished by their brilliant red colour and mild pungency. Chilli is a heating spice and comes in a wide variety of shapes, sizes, colours, and degrees of pungency. Chilli is Americas most important contribution to the world of spices, though today it is one of Indias major export attractions. Indian chilli is grown in Andhra Pradesh, Maharashtra, Karnataka, Madhya Pradesh, Tamil Nadu and a number of other States. The highly pungent Guntur and the mildly pungent Byadgi chillies are internationally recognised as the finest in quality.', '58.00', '55.00', 1, '2020-07-20 14:15:39', '2020-08-21 22:03:13', NULL),
(1209, 10, 0, 3, '1208', 'Everest Masala - Pav Bhaji,', '200.00', 'Everest presents their authentic range of masalas that are blended with a wide variety of handpicked and selected spices that bring a whole new flavour and meaning to your dishes. Rake up your favourite recipes and cuisines by adding this magical blend of Everest masalas.', '135.00', '135.00', 1, '2020-07-20 14:16:42', '2020-07-20 14:16:42', NULL),
(1210, 10, 0, 3, '1209', 'Mdh Powder - Kashmiri Chilli,', '100.00', 'MDH Powder - Kashmiri chilli imparts a rich flavor and color to dishes, mainly tandoori and other marinades. It has a great red color and a little sweet flavor. When used in curry, it imparts bright red color making food more good-looking and pleasant.', '65.00', '60.00', 1, '2020-07-20 14:17:54', '2020-08-21 22:36:41', NULL),
(1211, 10, 0, 2, '1210', 'Kohinoor Basmati Rice - Charminar, Long Grain', '1.00', 'Charminar Long Grain Rice is a tribute to the remarkable taste of the Nizams. This distinct blended Basmati Rice is superior in quality making it perfect for special occasions and banquets where recipes are prepared in bulk. It is processed with utmost care so that every dish you cook brims with the flavor of generations.', '110.00', '72.00', 1, '2020-07-20 14:20:05', '2020-07-20 14:20:05', NULL),
