(1215, 10, 0, 3, '1214', 'Everest Masala - Shahi Biryani', '50.00', 'Everest Shahi Biryani Masala is the perfect blend of the different aromatic spices that are required to prepare an appetising plate of biryani. It saves you the trouble of preparing the spice mix that gives Biriyani its unique flavour. It\'s largely a combination of flavouring spices along with taste agents that enhance the aroma of ordinary rice.', '70.00', '70.00', 1, '2020-07-20 14:26:19', '2020-07-20 14:26:19', NULL),
