(1218, 10, 0, 2, '1217', 'Dhara Refined Oil - Rice Bran (Natural Oryzanol & Vitamin E),', '1.00', 'Dhara refined rice bran oil is high in Vitamin E and mono-unsaturated fatty acids. Food fried in this oil supposedly absorbs less oil ensuring lower calorie intake. It has reasonably balanced fat composition (MUFA, PUFA and SFA) apart from the presence of Oryzanol.', '150.00', '122.00', 1, '2020-07-20 14:53:19', '2020-08-21 22:53:21', NULL),
