(1220, 10, 0, 3, '1219', 'Dabur Hommade - Ginger Garlic Paste,', '200.00', 'Dabur Hommade Ginger Garlic paste is made from freshest garlic paste and ground ginger paste in one hygienically sealed bag. The time one spends peeling, grinding and pasting these spices can now be saved with Dabur Hommade’s Ginger Garlic Paste. Every ingredient used in our ginger garlic paste recipe is fresh – right from the ginger that is sourced from North-Eastern states to the garlic that is sourced from Gujarat. Our Hommade range is an inspiration for seasoned cooks, experimental folks who like to try cooking and aspiring chefs-to-be. \r\n\r\nOur Ginger Garlic Paste contains no Added Colours. \r\nIt is thick and grainy, providing the texture of freshly ground paste at Home.  \r\n2 tbsp of our Hommade Ginger Garlic Paste is equivalent to 1.25 cm long ginger piece and 4-6 cloves of garlic, make sure you use in recipes accordingly.\r\nSpeaking of recipes, it is great to be used in Rasams, Kebabs, Sambhar, Matar Paneer, Malai Kofta.\r\nFreshest ingredients always - the taste of Hommade!', '48.00', '48.00', 1, '2020-07-20 14:55:29', '2020-07-20 14:55:29', NULL),
