(1306, 14, 0, 3, '1305', 'Bru Filter Coffee - Green Labe', '500.00', 'Loved by consumers since 1962, Bru Green Label Coffee is Indias first packaged filter coffee with a perfect mix of 53% coffee and 47% chicory. Its lightly roasted ground coffee beans give out a perfect decoction for a rich & smooth flavourful cup that helps rejuvenate your senses. The nitro flush packaging retains its fresh flavour and aroma providing rich tasteful notes. Kick-start your day with a cup of fresh and aromatic Bru Green Label Coffee. So filter a cup, unwind and relax as you enjoy the coffee breaks you deserve. Buy Bru Green Label Coffee now, right here. \r\nABOUT BRU: A part of Hindustan Unilever ltd., BRU Coffee is Indias largest and favourite coffee brand that offers a wide variety of coffee products. Since 1968, Bru has been a pioneer in bringing the authentic taste of coffee to Indian consumers. The best coffee beans are selected from across innumerable coffee trails and freshly roasted, to serve a great cup of rich, irresistible coffee. BRU has four distinct offerings', '168.00', '147.00', 1, '2020-07-21 15:09:02', '2020-07-21 15:09:02', NULL),
(1307, 14, 0, 2, '1306', 'Maaza Fruit Juice - Mango', '3.00', 'Maaza is the indulging, ready-to-serve mango drink, made from mango pulp and handpicked Alphonso. Maaza, in India, is synonymous with the very spirit of mangoes. Enjoy the deliciously thick, sweet and purely indulgent mango experience with a chilled glass of Maaza, a quality product of The Coca-Cola Company. The drink is universally loved for its taste, colour, thickness and wholesome properties. This delicious mango drink is the mango lovers first choice because if you have laalach for aam, Maaza hai naam!', '150.00', '134.00', 1, '2020-07-21 15:15:43', '2020-07-21 15:15:43', NULL),
(1308, 14, 0, 3, '1307', 'Nescafe Coffee - Classic', '200.00', '100% natural coffee\r\n100% pure natural coffee beans go into making every granule of NESCAFE Classic. With the new world class ERA technology, you get richer aroma and an unmatched coffee experience to stimulate your senses every morning with your favourite NESCAFE.\r\nDonot forget Coffee is 100% natural and contains antioxidants. Antioxidants help to fight free radicals.\r\nSo grab your favourite NESCAFE CLASSIC and kick start your day the NESCAFE way!', '580.00', '578.00', 1, '2020-07-21 15:18:09', '2020-07-21 15:18:09', NULL),
(1309, 14, 0, 2, '1308', 'Tropicana Fruit Juice - Delight, Litch', '2.00', 'Savour the superior taste of litchis! Special 6-layer protection gives you the best of tasty, ready to serve fruit beverage in every glass of Tropicana. Did You Know? Litchi was first cultivated as early as 1700 BC. They are known to be an excellent source of vitamins and minerals', '220.00', '180.00', 1, '2020-07-21 15:20:47', '2020-07-21 15:20:47', NULL),
