(1311, 14, 0, 2, '1310', 'Tropicana Fruit Juice - Orange Delight,', '2.00', 'Enjoy the refreshing and delicious taste of oranges with this Orange Delight by Tropicana. Its special 6-layer protection gives you the goodness of this tasty, ready-to-serve fruit beverage in every glass of Tropicana.', '220.00', '180.40', 1, '2020-07-21 15:24:04', '2020-07-21 15:24:04', NULL),
