(1314, 14, 0, 2, '1313', 'Tropicana Fruit Juice - Apple Delight', '2.00', 'Enjoy the refreshing and delicious taste of apples! Now in a bottle! Drink the goodness you can see. With no added preservatives, colours or artificial flavouring, Tropicana puts the good in the morning across its different flavours.', '200.00', '150.00', 1, '2020-07-21 15:37:39', '2020-07-21 15:37:39', NULL),
(1315, 14, 0, 2, '1314', 'Tropicana 100% Mixed Fruit Juice,', '2.00', 'Tropicana 100% Mixed fruit juice has no added sugar for a healthy you. With no added preservatives, colour or artificial flavouring, Tropicana puts the good in the morning. Add a glass of Tropicana 100% to your breakfast and give your day a great start. Its 9 nutrients revitalize your body and awaken your senses. Be alive, all day long.', '270.00', '202.50', 1, '2020-07-21 15:38:49', '2020-07-21 15:38:49', NULL),
(1316, 14, 0, 2, '1315', 'Aquafina Packaged Drinking Water', '6.00', 'Perfect companion for happy bodies everywhere. Aquafina goes through a five step state-of-the-art purification process to give consumers pure water and perfect taste. It has become one of Indias leading brands of bottled water in a relatively short span of time.', '120.00', '114.00', 1, '2020-07-21 15:39:50', '2020-07-21 15:39:50', NULL),
(1317, 14, 0, 3, '1316', 'Lipton Honey Lemon Green Tea Bags,', '35.00', 'It’s not just a cup of tea, its therapy - One Sip at a Time. Lipton Green Tea is not just a regular cup of chai, we believe it’s a therapy for your body. Wake up to a morning cup of hot Lipton green tea and feel how it leaves you feeling light and active. Awaken your senses - one sip at a time. Buy Now! \r\n\r\nMagic of Green Tea Green tea is produced when freshly plucked leaves are heated, rolled/cut and then dried. The catechins in the fresh leaves are preserved during the green tea process, making green tea rich in catechins. Also, green tea is typically drunk without milk and sugar and hence gives zero calories as compared to the ordinary chai made with milk and sugar. \r\n\r\nAvailable in a range of flavours, Lipton offers a range of different flavours to ensure that you are offered variety and enjoyment while drinking tea. Lipton flavours some of its teas with added natural flavours and no artificial flavours are used. \r\n\r\nYou may try Lipton Green tea in Pure & Light (unflavored), Tulsi ', '160.00', '160.00', 1, '2020-07-21 15:46:58', '2020-07-21 15:46:58', NULL),
(1318, 14, 0, 2, '1317', 'Kinley Mineral Water,', '15.00', 'Kinley water understands the value and importance of this life giving force. They might claim to be secure but it is what you can trust. It is truly pure and safe. It comes with a guarantee of safety from The Coca-Cola Company.', '300.00', '225.00', 1, '2020-07-21 15:48:21', '2020-09-16 20:39:53', NULL),
(1319, 14, 0, 2, '1318', 'Appy Juice - Sparkling Apple', '2.00', 'Appy Fizz sparkling Apple juice is carbonated. It contains vitamin A. It has a very tasty delicious taste. Appy Fizz is India\'s first-ever bright apple juice drink. It consists of sparkling apple juice, and is used as the basis for cocktails and is a well-liked drink with the youth.', '110.00', '110.00', 1, '2020-07-21 15:50:06', '2020-07-21 15:50:06', NULL),
(1320, 14, 0, 5, '1319', 'Bisleri Mineral Water, 250 ml Pack of 48', '250.00', 'Bisleri Mineral Water is definitely one of the healthiest kinds of bottled water and drinking it can enhance your well-being. This water is rich in minerals such as magnesium, calcium and iron. It is free of preservatives or any type of added chemicals. Those who are planning to lose weight should switch to mineral water as it does not contain harmful ingredients present in soda and cold drinks.', '288.00', '288.00', 1, '2020-07-21 15:52:36', '2020-07-21 15:52:36', NULL),
(1321, 14, 0, 3, '1320', 'Complan Nutrition & Health Drink - Royale Chocolate', '500.00', 'Complan is a scientifically developed nutrition and health drink with clinically proven formula to give kids’ 2 times faster growth. This milk protein-based formula also supports immune function, helps brain development & functioning. Serve Complan to your kid two times a day as part of their daily balanced diet and help your children grow 2 times faster. Available in 4 delicious flavours - Royale Chocolate, Creamy Classic, Kesar Badam and Pista Badam.\r\n\r\nComplan is a nutrition and health drink with clinically proven formula to deliver 2 times faster growth\r\n\r\nContains 100% First Class Protein\r\n\r\nContains 34 Vital Nutrients\r\n\r\nNutrients like Vitamin A, E &C supports immune function\r\n\r\nNutrients like Iodine, Iron, Vitamin B12 and Folic Acid helps Brain development and it’s functioning\r\n\r\nNutrients like Sodium, Potassium & Chloride maintains fluid balance in the body\r\n\r\nCan be consumed with milk or water', '280.00', '266.00', 1, '2020-07-21 15:54:28', '2020-07-21 15:54:28', NULL),
(1322, 14, 0, 4, '1321', 'Taj Mahal Tea', '25.00', 'When the history of Tea is written down, 1966 will be a celebrated Chapter. For in that year, Brooke Bond Taj Mahal Tea was born, with a promise - To foster excellence in each Cup. Fifty years on, we have not forgotten that promise. Ordinary teas usually provide either strength of just flavour. However, Only Brooke Bond Taj Mahal Tea contains the precious essence of the Finest fresh tea leaves, giving you the perfect balance of strength and flavor. A flavor, which can only be matched by the exquisite melodies composed by the maestros who have been our ambassadors over the decades.\r\n• Rigor in Selection and Blending\r\n• The tea from every tea estate has its own taste - because of its terroir, pluck and flush. How then do we turn it all into the unique Taj experience for our customers - year after year? Enter our master tasters and blenders, and their traditions, built over many years. It takes millions of tastings and years of experience to be a taste for Taj Mahal Tea. The brew is golde', '55.00', '55.00', 1, '2020-07-21 16:00:52', '2020-07-21 16:00:52', NULL),
