(1326, 14, 0, 3, '1325', 'Glucon-D Glucose Based Beverage Mix - Orange', '800.00', 'Indias number 1 glucose powder with vitamin and minerals. It contains Glucose for an instant energy boost. It contains an added Tangy Orange flavour for a tasty twist. Contains vitamin C for mental alertness. A quick source of energy to fight summer tiredness. Ideal for growing children and their everlasting activeness. Also available in delicious Nimbu Pani, Mango Punch and Regular flavours.\r\n\r\nSummers can be daunting but thank god there is Glucon-D! It contains glucose that helps replenish body glucose for an instant energy boost. Enriched with Vitamin-C and Minerals, including Calcium and Phosphorus, this glucose drink helps you fight tiredness. Also, added Tangy Orange flavour makes it loved by everyone. Add Glucon-D to a glass of water every day to provide growing active children with the energy that keeps them going and adults, refreshment after a long day. \r\n\r\nNote: Fruits are for creative depiction. Glucon-D does not contain fruits.', '256.00', '256.00', 1, '2020-07-21 16:07:29', '2020-07-21 16:07:29', NULL),
(1327, 14, 0, 3, '1326', 'Glucon-D Instant Energy Health Drink - Nimbu Pani,', '75.00', 'Summers can be daunting and especially when there\'s an enormous scorching sun always ready to drain out your energy and stop you from being the best of you. But thank god there is Glucon-D! Glucon-D contains glucose that helps replenish body glucose and fills you with the energy required to stay active. It is easily absorbed by the body, thus giving out an instant energy boost and refreshment.\r\n\r\n Enriched with Vitamin-C and Minerals, including Calcium and Phosphorus, this glucose drink helps charge you up to fight tiredness and promotes mental alertness. What\'s better? Added Nimbu Pani flavour makes it loved by children as well as adults. Add Glucon-D to a glass of water every day to provide growing active children with the energy that keeps them going and adults, refreshment after a long day.\r\n\r\n•Glucon D fills you with the energy required to stay active\r\n•Kick away tiredness and feel rejuvenated with Glucon-D, the preferred choice in summer when the scorching heat drains out body gl', '40.00', '36.00', 1, '2020-07-21 16:18:00', '2020-08-25 23:17:10', NULL),
