(1330, 14, 0, 5, '1329', '7 Up Soft Drink - Lemon Flavour, Pack of 2', '1200.00', '7UP’s sparkling and crisp lemon and lime flavour keep you positive and confident against all odds. It aims to connect with people who choose to be their natural self and stand out in the crowd. 7UP celebrates the “Hum toh hain like this!” attitude of consumers.', '70.00', '70.00', 1, '2020-07-21 16:23:17', '2020-07-21 16:23:17', NULL),
(1331, 14, 0, 2, '1330', 'Tropicana Slice Mango Juice', '3.50', 'India and mangoes go a long way. A fruit so succulent, so sweet and so desired, that Indians waited impatiently for the seasons to turn and bring them closer to their beloved fruit. Keeping this fascination of mangoes, we present you Slice which is a refreshing Mango Drink which celebrates the taste of mangoes! Tropicana\'s fruit expertise and Slice\'s taste perfection have come together and Slice is now Tropicana Slice.', '180.00', '163.80', 1, '2020-07-21 16:26:12', '2020-07-21 16:26:12', NULL),
(1332, 14, 0, 1, '1331', 'Glucon-D Glucose Based Beverage Mix - Mango', '1.00', 'Summers can be daunting and especially when there\'s an enormous scorching sun always ready to drain out your energy and stop you from being the best of you. But thank god there is Glucon-D! Glucon-D contains glucose that helps replenish body glucose and fills you with the energy required to stay active. It is easily absorbed by the body, thus giving out an instant energy boost and refreshment.\r\n\r\nEnriched with Vitamin-C and Minerals, including Calcium and Phosphorus, this glucose drink helps charge you up to fight tiredness and promotes mental alertness. What\'s better? Added Mango flavour makes it loved by children as well as adults. Add Glucon-D to a glass of water every day to provide growing active children with the energy that keeps them going and adults, refreshment after a long day.', '310.00', '294.50', 1, '2020-07-21 16:53:10', '2020-07-21 16:53:10', NULL),
