(1334, 16, 0, 3, '1333', 'MAGGI 2-Minute Instant Noodles - Masala,', '840.00', 'India’s favourite Masala Noodles, MAGGI 2-minute Noodles, now comes with the goodness of Iron. Each portion (70g) of MAGGI Masala Noodles provides you with 15% of your daily Iron requirement (*as per the Daily Dietary Allowances for an Adult Sedentary Male (ICMR 2010). Containing your favourite masala taste, MAGGI noodles are made with the finest quality spices and ingredients. Make your bowl of MAGGI even better by chopping up some vegetables, dropping in an egg or throwing in your favourite ingredients.', '144.00', '144.00', 1, '2020-07-21 17:05:03', '2020-07-21 17:05:03', NULL),
(1335, 13, 0, 3, '1334', 'Parle Gluco Biscuits - Parle-G', '800.00', 'Filled with the goodness of milk and wheat, Parle-G is a source of all round nourishment. Treat yourself to a pack of yummy Parle-G biscuits to experience what has nurtured and strengthened millions of people for over 70 years. A meal substitute for some and a tasty and healthy snack for many others. Consumed by some for the value it offers, and many others for its taste. Whatever the occasion, it has always been around as an instant source of nourishment.', '70.00', '64.00', 1, '2020-07-21 17:07:30', '2020-08-26 18:52:05', '2020-08-26 18:52:05'),
