(1337, 13, 0, 3, '1336', 'Britannia Good Day Cookies - Rich Cashew', '400.00', 'Combining the kindness of cookies with the crunchiness and good of cashews, Britannia Good Day rich cashew biscuits will create a delicious blast in your mouth. Great with tea/coffee or on its personal, it makes for a vast bite to share and reach joy.', '80.00', '72.00', 1, '2020-07-21 17:11:44', '2020-08-26 18:58:49', '2020-08-26 18:58:49'),
(1338, 13, 0, 3, '1337', 'Lays Potato Chips - American Style Cream & Onion Flavour', '180.00', 'Relish the delectable combination of sour and cream perfectly blended with herb and onion flavour. From the everyday snack to the impromptu get-togethers, LAYS chips are the perfect addition to any occasion. Whether its party time or family time, everyone loves gathering around the chip bowl. About the brand: Lays, the worlds largest and favourite snack food brand, has steadily established itself as an indispensable part of Indias snacking culture since its launch in 1995. With its irresistible taste, international and Indian flavours, Lays has established itself as a youth brand and continues to grow in the hearts and minds of its consumers. Lays is made with Indias best-quality fresh potatoes, simply sliced and cooked in edible vegetable oils, and then seasoned with delicious flavours!', '70.00', '62.00', 1, '2020-07-21 17:13:26', '2020-07-21 17:13:26', NULL),
