(1340, 16, 0, 3, '1339', 'MAGGI Nutri-Licious Masala Veg Atta Noodles, (Pack of 4)', '290.00', 'Introducing the MAGGI NUTRI-LICIOUS Masala Veg Atta Noodles with appetizing aroma and delicious masala taste made using 20 Spices & Herbs. These masalas are roasted to perfection (Refer pack for more details) for an aroma & flavour which you will love. These MAGGI NUTRI-LICIOUS Masala Veg Atta Noodles are a truly a good combination of delicious and nutritious Wheat Flour (Atta), Colorful Vegetables & 20 Spices & Herbs. Also, loaded with the goodness of wheat,  each meal is deliciously filling. Each serve (72.5g) of the MAGGI Masala Veg Atta Noodles is a Source of Fibre & Iron (Refer pack for more details).\r\n\r\n Making MAGGI NUTRI-LICIOUS Masala Veg Atta Noodles is as easy as it could ever be – Simply empty the Masala Tastemaker(R) Sachet into 1 ½ teacup (225 ml) of boiling water, add the noodles cake, & stir. Cook for 3 minutes and wait for your favourite \"Surprisingly Awesome\" MAGGI Masala Veg Atta Noodles. In just 3 minutes, now you can enjoy a balance of taste & health at any time of', '86.00', '75.00', 1, '2020-07-21 17:21:25', '2020-08-26 19:02:40', NULL),
(1341, 13, 0, 3, '1340', 'Cadbury Dairy Milk Chocolate', '150.00', 'Cadbury Dairy Milk Chocolate is for those everyday moments of joy that you want to share with your near and dear ones with something sweet. Just one bite will take you into the world of warmth, happiness and spontaneous fun. Rich, smooth and creamy Classic Milk Chocolate which gives you more joy in every bite.', '120.00', '120.00', 1, '2020-07-21 17:24:50', '2020-07-21 17:24:50', NULL),
(1342, 16, 0, 3, '1341', 'Desi Hakka Noodles - Veg', '800.00', 'It is ready to cook noodles having good taste and gives energy when cooked. Desi Noodles is the adaptation of Chinese seasoning and cooking techniques to cater to Indian tastes. Today, Noodles is an integral part of the Indian diet. Hakka label refers to the Chinese origins of the noodles. Hakka belongs to Hakka Han region and is also a language in China. When cooked, it is an apt dish for kitty parties and celebrations.', '130.00', '130.00', 1, '2020-07-21 17:26:17', '2020-07-21 17:26:17', NULL),
(1343, 13, 0, 3, '1342', 'Parle Hide & Seek Chocolate6x33 g Multi Pack', '198.00', 'Hide & Seek Chocolate Chip Cookies are the most popular moulded chocolate chip cookie in the world. Each cookie is filled with decadent chocolate flavour. Hide & Seek Chocolate Chip Cookies are packed with delicious chocos which are not hidden in real and gets melted soon after you eating in your mouth.', '60.00', '60.00', 1, '2020-07-21 17:28:37', '2020-07-21 17:28:37', NULL),
(1344, 13, 0, 3, '1343', 'Britannia Nutri Choice Hi Fibre Digestive Biscuits', '250.00', 'Fibre is the name of the game. Britannias digestive biscuit is packed with multi-grain goodness that also provides your body with essential dietary fibres. This soft and flaky biscuit is one of the products from the house of Britannia which is globally known for its high-quality confectionery and other products.', '55.00', '52.00', 1, '2020-07-21 17:34:42', '2020-07-21 17:34:42', NULL),
(1345, 16, 0, 3, '1344', 'Kelloggs Corn Flakes', '475.00', 'Kelloggs Corn Flakes cereal is a nourishing and wholesome breakfast. It is prepared from actual natural corn, with iron and 8 essential Vitamins containing A, C and B-Group Vitamins, it provides the balanced combination of nourishment and original corn flavour. It is a convenient breakfast option that gives energy even after 3 Hours. Every bite of these crispy, golden flakes is just as delicious as the first. You will be on your way to a great day when you pour Kelloggs Corn Flakes cereal into your breakfast bowl. Grab a pack and kick-start your day with good health and great taste. A quick and convenient breakfast in just 2-3 minutes.', '180.00', '179.00', 1, '2020-07-21 17:37:03', '2020-07-21 17:37:03', NULL),
(1346, 16, 0, 3, '1345', 'Sunfeast Noodles - Magic Masala', '240.00', 'ITC entered the instant noodles segment with the launch of Sunfeast Yippee! in 2010. The sourcing and blending expertise that has made Aashirvaad Indias No 1 branded Atta has been leveraged to create a delightful noodle block. The block being round in shape does not need to be broken while cooking, providing really long & slurpy noodles. A special scientific process ensures that the noodles do not lump even 30 minutes after cooking. \r\n\r\nYippee! instant noodles are available in three lip-smacking variants - Classic Masala, Magic Masala and Chinese Masala. Classic Masala is the Classical Indian Masala flavour with a perfect blend of spices. Magic Masala is a special masala created by ITC with spices and also has five different types of dehydrated vegetables. Chinese Masala is a unique combination of Chinese and Masala Flavours.', '46.00', '43.00', 1, '2020-07-21 17:38:19', '2020-07-21 17:38:19', NULL),
(1347, 13, 0, 3, '1346', 'Sunfeast Dark Fantasy - Choco Fills', '900.00', 'Indulge your senses with the heavenly taste of Sunfeast Dark Fantasy Choco Fills.', '360.00', '291.00', 1, '2020-07-21 17:40:30', '2020-07-21 17:40:30', NULL),
(1348, 13, 0, 3, '1347', 'Lays Potato Chips - Indias Magic Masala, Party Pack', '334.00', 'Taste the unbeatable blend of delectable Indian spices with best quality potatoes.Delicious Party Size bag- perfect for sharing at home, at parties and picnics. About the brand- Lays, the worlds largest and favourite snack food brand, has steadily established itself as an indispensable part of Indias snacking culture since its launch in 1995. With its irresistible taste, international and Indian flavours, Lays has established itself as a youth brand and continues to grow in the hearts and mind of its consumers. Lays is made with Indias best-quality fresh potatoes, simply sliced and cooked in edible vegetable oils, and then seasoned with delicious flavours!', '130.00', '110.00', 1, '2020-07-21 17:44:57', '2020-07-21 17:44:57', NULL),
(1349, 13, 0, 3, '1348', 'Britannia Milk Bikis Biscuits', '80.00', 'Milk Bikis has been trusted by mothers as a source of develops energy of milk and their loyalty to the brand has made it an essential part of their children\'s nutrition regimen. This biscuit is equipped with smart nutrients‚ iron, 4 vital vitamins and iodine, proven to help mental and physical development in growing kids.', '10.00', '10.00', 1, '2020-07-21 17:53:38', '2020-07-21 17:53:38', NULL),
(1350, 13, 0, 3, '1349', 'Cadbury Dairy Milk Silk Chocolate Bar', '300.00', NULL, '320.00', '295.00', 1, '2020-07-21 17:56:42', '2020-07-21 17:56:42', NULL),
(1351, 13, 0, 3, '1350', 'ACT II Instant Popcorn - Classic Salted', '90.00', 'An indigenously developed premix of popping corn, oil and seasoning, Act II Instant Popcorn can be made in a heavy bottomed pan/cooker in just 3 minutes. Act II Instant Popcorn has a mass appeal and is preferred widely, since microwave ovens are still not available in many consumer homes and also, these can be made anywhere with a heavy bottomed lid pan, even without electricity. Act II Instant popcorn is an economically priced snack and serves two bowls of popcorn in just Rs. 10/20/30. It is available in variety of lip smacking flavors- Classic Salted, Golden Sizzle, Chilli Surprise, Tomato Chilli, Butter Delite, Butter Pepper, Tandoori Tadka and Southern Spices.', '30.00', '30.00', 1, '2020-07-21 17:58:18', '2020-09-07 20:40:27', NULL),
(1352, 16, 0, 3, '1351', 'McCain Crunchy Potato Nuggets - Chilli Garlic Potato Bites,', '700.00', 'Potato (80%), Edible Vegetable Oil (Palmolein), Corn Flour, Potato Flakes [Potato, Emulsifier (E450(i), E223 & E471), Acidity Regulator (E330), Antioxidant (E304), Garlic Paste [Garlic, Corn starch, Salt, Acetic Acid, Preservatives (E211), Iodized Salt, Onion Powder, Red Chilli Flakes', '175.00', '160.00', 1, '2020-07-21 18:00:11', '2020-09-07 21:23:00', NULL),
(1353, 13, 0, 3, '1352', 'Bingo Mad Angles Chips - Achaari Mast', '130.00', 'Remember when granny\'s mango pickles used to be our jugaad from horrible hostel mess food? We took that feeling and turned it into fun, delicious and perfect triangular snack. The sugary and spicy flavours will carry back memories of your granny\'s mango pickles. You can take a bite from any angle and it transports you to that messy, fun hostel room filled with laughter, love and music! A combination of innovative flavours on a traditional khakra base, Bingo! Mad Angles is a snack that is true to taste with perfect flavour delivery as well as shape, making it a snack that\'s truly \"Har Angle se Mmmm...\"', '50.00', '50.00', 1, '2020-07-21 18:01:56', '2020-07-21 18:01:56', NULL),
(1354, 16, 0, 1, '1353', 'MAGGI Ketchup Tomato', '1.00', 'MAGGI Sauces have been an integral part of the Indian consumers households for decades now. Launched in the mid-1980s, MAGGI Sauces has been associated with category re-defining innovations from the very beginning, starting with the launch of the unique MAGGI Hot & Sweet and Its different commercials featuring Jaaved Jaffrey and Pankaj Kapoor. Over the years, MAGGI has continuously re-invented itself in terms of new products, packaging, promotion & distribution to emerge and sustain itself as one of the largest sauces brand in India.\r\nTo cater to the diverse Indian palate, MAGGI has a host of variants, including:\r\n• The quintessential Rich Tomato Ketchup and Rich Tomato Sauce (No Onion No Garlic).\r\n• The unique Hot & Sweet Tomato Chilli Sauce.\r\n• The tangy and chatkaaredar Imli Pichkoo.\r\nMAGGI has also launched the Rich Tomato Ketchup and Hot & Sweet Tomato Chilli Sauce in a convenient doy pack format called Pichkoo that has made the unique flavors of MAGGI affordable to a whole new se', '147.00', '134.00', 1, '2020-07-21 18:05:05', '2020-09-15 20:44:06', NULL),
(1355, 13, 0, 3, '1354', 'Milkybar White Chocolate - Creamy', '25.00', 'Milkybar is one of the UK and Ireland\'s best loved brands, and is the No.1 White Chocolate brand. MILKYBAR is enjoyed by both kids and adults alike. With milk* as the #1 ingredient, MILKYBAR chocolate is now creamier and yummier than ever. Each of the Nestle MILKYBAR Chocolate moulds (1 portion=2 mouls or half of a 25g bar) melt in your mouth and makes for a scrumptious treat. The soft deliciousness of the MILKYBAR Mould now comes with a fun and interesting puzzle on every bar. So, play the puzzle on the bar to see what picture you can make with your family and enjoy the simple moments! This pack of 6 is ideal for parties, sharing or gifting.', '20.00', '20.00', 1, '2020-07-22 12:31:15', '2020-07-22 12:31:15', NULL),
(1356, 13, 0, 3, '1355', 'Nestle Kitkat Chocolate', '126.00', 'Nestle KITKAT Chocolate cover Wafer Fingers is the ideal snack for those who really value their break. It\'s the ideal treat when you\'re enjoying a break, alone or with friends. Just unwrap the bar and break off one of the wafer fingers, snap it into two and savour the deliciously smooth milk chocolate and the crispy wafer beneath. Enjoying chocolate as part of a balanced diet is one of life\'s little pleasures and this KITKAT treat makes a perfect snack to have as part of a balanced diet with only approximately 47 calories per finger (1 portion = 2 fingers) and 2% of an average adult\'s Guideline Daily Amounts (GDA). Nestle KIT KAT is also great for baking, dipping, and candy making. So, bake your way to delicious KIT KAT chocolate recipes and enjoy the tempting taste. So when it\'s time to Have a break, have a KitKat! PROUDLY USING SUSTAINABLE COCOA NESTLe KITKAT uses sustainably sourced cocoa from the NESTLe COCOA PLAN. The NESTLe COCOA PLAN aims to improve the lives of cocoa farming co', '100.00', '90.00', 1, '2020-07-22 12:33:15', '2020-09-07 21:49:44', NULL),
(1357, 16, 0, 3, '1356', 'MAGGI Nutri-Licious Masala Oats Noodles(Pack of 4)', '290.00', 'Introducing the MAGGI NUTRI-LICIOUS Masala Oats Noodles with an appetizing aroma and delicious masala taste made using 20 Spices & Herbs. These masalas are roasted to perfection (Refer pack for more details) for an aroma & flavour which you will love. These MAGGI NUTRI-LICIOUS Masala Oats Noodles are a truly a good combination of delicious and nutritious Oats Flour, Colorful Vegetables & 20 Spices & Herbs. Also, loaded with the Goodness of Oats, each meal is deliciously filling. Each serve (72.5g) of the MAGGI Masala Oats Noodles is a Source of Fibre & Iron (Refer pack for more details).\r\n\r\nMaking MAGGI NUTRI-LICIOUS Masala Oats Noodles is as easy as it could ever be – Simply empty the Masala Tastemaker(R) Sachet into 1 ½ teacup (225 ml) of boiling water, add the noodles cake, & stir. Cook for 3 minutes and wait for your favourite \"Surprisingly Awesome\" MAGGI Masala Oats Noodles. In just 3 minutes, now you can enjoy a balance of taste & health at any time of the day!\r\n\r\nEnjoy your MAGG', '98.00', '92.00', 1, '2020-07-22 12:37:30', '2020-08-26 20:08:44', NULL),
(1358, 13, 0, 3, '1357', 'Parle Marie Biscuits,', '250.00', 'Parle Marie biscuits are known for holding great taste and it is also nutritionally proved to be the most excellent for your strength. Crunchiness, taste and freshness, which are supreme, are presented by our Parle Marie Biscuits. Enjoy a wonderful bite grab the most excellent Parle Marie Biscuit.', '30.00', '25.00', 1, '2020-07-22 12:38:35', '2020-08-26 20:16:39', NULL),
(1359, 16, 0, 3, '1358', 'MAGGI Masala Noodles - Special,6x70 g Multipack', '420.00', 'Nestle MAGGI 2-Minutes Masala Noodles have been a classic Indian snack for more than a decade. To take your favourite Masala taste experience to the next level, MAGGI introduces the New MAGGI Special Masala Noodles, a recipe of 20 Spices and Herbs that provides a more REDEFINED MAGGI Masala experience! Made with a blend of finely ground and whole spices, and herbs, the all-new MAGGI Instant Noodles have an extra special and flavourful tastemaker sachet inside. These spices have been roasted to perfection, providing a distinct aroma and colour to your MAGGI noodles. The good Maggi taste also comes fortified with iron and provides 15% of your total iron need per day. The pack contains a single noodle cake and a tastemaker.', '90.00', '90.00', 1, '2020-07-22 12:41:33', '2020-07-22 12:41:33', NULL),
(1360, 16, 0, 3, '1359', 'Bambino Vermicelli,', '400.00', 'Bambino Vermicelli is an effortless, healthy and wholesome breakfast recipe. It is simple on the stomach, high in fbre and low in calories. It is non-sticky and doesn\'t form clumps. It is very delicious snacks in the nightfall.', '40.00', '35.00', 1, '2020-07-22 12:48:16', '2020-09-08 17:51:51', NULL),
