(1362, 13, 0, 3, '1361', 'Britannia Good Day Chocochip Cookies.', '100.00', 'Dressed in chocolaty perfection, Britannia Good Day Chocochip Cookies offer the crazy crumble of chocolate cookies with a generous sprinkle of rich and gooey choco chips… Let your little ones dunk these cookies in their glass of milk and make breakfast more exciting. Works equally well with gossip over tea or a midnight nibble. \r\n\r\nThere’s so much chocolaty goodness in every bite, it’s irresistible! What’s more? It packs in more Good Day Smiles for you, offering 27% extra delights! Store them in an airtight container and enjoy this yummy indulgence for up to 6 months.', '30.00', '27.00', 1, '2020-07-22 12:51:08', '2020-08-31 20:25:14', NULL),
(1363, 16, 0, 3, '1362', 'McCain Aloo - Tikki', '760.00', 'Potato (73%), Edible Vegetable Oil, Corn Flour, Rice Flakes, Green Chilli Paste(Green Chilli, Water, Corn Starch, Edible Common Salt, Acdiity Regulator, [INS 260, INS 330], Permitted Class II Preservative INS 211)], Ginger Paste (Ginger, Water, Corn Strach, Edible Common Salt Acidity Regulator, [INS 200], Permitted Class II Preservatives [INS 211]), Edible Common Salt, Onion Powder, Red Chilli Flakes, Cumin Seeds.', '170.00', '161.00', 1, '2020-07-22 12:53:15', '2020-08-26 20:44:29', NULL),
(1364, 16, 0, 3, '1363', 'Knorr Instant Tomato Chatpata Cup-A-Soup,', '14.00', 'Knorr Tomato Chatpata Cup-A-Soup is the perfect combination of tomato with sour, sweet, salty, and spicy flavours making this cup-a-soup an instant hit. Knorr Tomato Chatpata Cup-A-Soup satisfies your small hunger pangs in just 1 minute. Its crunchy, delicious and easy to make every time. Made with 100% real vegetables and no added preservatives, this soup is ready in three simple steps. So now enjoy Restaurant like delicious Soup at home.Knorr Soups range comprises of 11 delicious flavours of 4 serve soups and 7 flavours of Cup-a-soup. Great taste is in our Nature! Knorr has gone to great lengths to ensure a perfect blend of Ingredients and consistency that give you Restaurant like Soup at home.About Knorr: Just like you, we love everything about food, because no delicious meal is cooked without love. Love for carefully selected Ingredients, flavours and spices, or the aroma of dinner wafting through your home. Love for the people you feed everyday; your family and friends, relatives', '10.00', '9.00', 1, '2020-07-22 12:55:48', '2020-09-15 18:56:50', NULL),
(1365, 13, 0, 3, '1364', 'Cadbury Gems Sugar Coated Chocolate', '8.90', 'Cadbury Gems is chocolate flavor, rich and chocolate buttons. What makes Gems different is the way the chocolate has been designed as colorful candy. Gems can be used to embellish puddings, cakes, biscuits, homemade chocolates and cookies. It is colourful, tasty and fun. Gems is loved by everyone. Add to any dessert for that extra touch or just eat it how it is for a guaranteed burst of flavours in your mouth.', '5.00', '5.00', 1, '2020-07-22 13:06:01', '2020-07-22 13:06:01', NULL),
(1366, 16, 0, 3, '1365', 'Kissan Sauce - Pizza & Pasta', '200.00', 'This one is definitely a winner when it comes to making the all popular Italian dishes at home. Its remarkable flavour comes from the 100% real ingredients that have gone in making it. Its a perfect blend of delicious and fresh tomatoes with basil and aromatic spices delivering a tangy taste to your palette. \r\nKissan Pizza & Pasta Sauce is a multipurpose sauce that can be used as a dip, spread or cooking sauce - an assured hero for all the continental dishes, be it a spread, for a pizza base, a mix for red pasta, a marinade or just as a dip with your favourite vegetables. With these sauces in your fridge, it is easier and quicker than ever to make your very own pizza and pasta at home! Kissans international sauces are packaged in easy-to-use 200g pouches so that you can easily drizzle, dip, spread, cook on to any dish of your choice and reseal it to restore its freshness. Started in 1934, Kissan is a popular brand in India. Kissan is more than just jams, ketchup, sauces and squashes. I', '55.00', '55.00', 1, '2020-07-22 13:07:20', '2020-07-22 13:07:20', NULL),
(1367, 13, 0, 3, '1366', 'Kurkure Namkeen - Masala Munch', '50.00', 'The Masala Munch is a classic Kurkure flavour with a great combination of spice and crunch. About the brand-Kurkure is a crunchy, new-age Pack namkeen snack brand which symbolizes light-hearted fun. Embodying Pack the spirit of India, Kurkure has found a home in millions of hearts and minds and enjoys the position of a strong love mark brand in India. Made with trusted kitchen ingredients- 100% vegetarian All the raw materials used in Kurkure comply with The Food Safety & Standards Act & Regulations 2006 and rules that govern the manufacture, distribution and sale of Kurkure.', '10.00', '9.50', 1, '2020-07-22 13:09:24', '2020-08-26 20:47:21', NULL),
(1368, 16, 0, 3, '1367', 'Chings Dark Soy Sauce', '200.00', 'Chings Dark soy sauce is an essential ingredient if you want to prepare cuisine of Chinese at home. The sauce is made from a mixture of sugar, soybeans and water which is then fermented that results in this distilled liquid. The delicious sauce is made with a traditional Chinese recipe.', '55.00', '50.00', 1, '2020-07-22 13:10:25', '2020-09-15 21:41:57', NULL),
(1369, 13, 0, 3, '1368', 'Britannia 50-50 Sweet & Salty Biscuits', '200.00', 'Britannia 50-50 Sweet & Salty Biscuits are prepared with the goodness of two completely distinct flavours blended together. Britannia biscuits, cookies, cakes and rusk are a perfect companion for your tea. Believing in delivering fresh and healthy products, Britannia India manufactures some of India\'s favourite brands like Good Day, Tiger, NutriChoice, Bourbon, Milk Bikis and Marie Gold.', '30.00', '28.00', 1, '2020-07-22 13:11:38', '2020-08-26 20:55:06', NULL),
(1370, 13, 0, 3, '1369', 'Parle Monaco', '200.00', 'Parle Monaco Salted Biscuits is a light crunchy biscuit which is offered with a namkeen or salty twist. It had any time of the day, and with something else.', '30.00', '30.00', 1, '2020-07-22 13:23:35', '2020-07-22 13:23:35', NULL),
