(1372, 16, 0, 3, '1371', 'Kelloggs Strawberry Corn Flakes', '300.00', 'Kelloggs Corn Flakes with Real Strawberry Puree is a tasty, nourishing and wholesome breakfast. The goodness of Strawberry cornflakes can be tasted in every bite and gives a kickstart to your day. It is prepared from actual natural corn, with iron and 8 essential Vitamins containing A, C and B-Group Vitamins, it provides a balanced combination of nourishment. Crunchy, lightly sweetened breakfast cereal with Real Strawberry Puree in every delicious spoonful, makes this an irresistible breakfast. Start off your day with a balanced, great-tasting breakfast that can put you on the fast track to good nutrition and better overall health. Kelloggs fortified corn flakes offer a low-fat, nutrient-dense, cholesterol-free food that encourages breakfast consumption.', '140.00', '140.00', 1, '2020-07-22 13:26:57', '2020-07-22 13:26:57', NULL),
