(1374, 16, 0, 3, '1373', 'Chings Green Chilly Sauce', '190.00', 'Sound the gong for the Chinese Chef! It is now no secret that Chings Secret has the best range of Chinese cooking products that help you recreate the magic of your favourite Chinese restaurant and cook up a few signature dishes for parties and guests! Chings Green Chilly Sauce is one of the products from this range.', '55.00', '50.00', 1, '2020-07-22 13:29:18', '2020-09-15 21:40:59', NULL),
(1375, 13, 0, 3, '1374', 'Lotte Choco Pie - Premium Quality', '56.00', 'Wheat Flour, Choco Covering (21%) (Sugar, Edible Vegetable Oils [Partially Hydrogenated], Cocoa Solids, Milk Solids, Emulsifiers (E322-Soya Lecithin E476)], Sugar, Liquid Glucose, Edible Vegetable Oils (Partially Hydrogenated), Sorbitol, Raising Agents (E500(ii), E503(ii), E341(i)), Iodised Salt, Stabilizers (E407, E415).', '25.00', '22.00', 1, '2020-07-22 13:40:49', '2020-09-15 20:04:40', NULL),
