(1378, 13, 0, 3, '1377', 'Nestle Munch Chocolate Coated Crunchy Wafer(20 Bars X 11.1 g each)', '222.00', 'Nestle MUNCH brings to you a wafer-based crunchilicious bar resulting in an explosive multi-sensorial crunch. MUNCH chocolate lets you discover something new with every bite. The chocolaty crunch gives MUNCH a sweet and delicious taste, so you can savour every bite. It’s the same irresistible taste that you have loved for years containing 20 yummy chocolate treats so you can have a fun time with family and friends. With each bar discover sensations, flavours and textures, unlike anything you’ve had before. Savouring chocolate as part of a balanced diet is one of life’s little pleasures and this MUNCH makes a perfect chocolaty treat with each portion of 11.1g containing approx. 54 kcal. So, break your way to mouth-watering MUNCH chocolate recipes or enjoy MUNCH bar as it is.', '100.00', '100.00', 1, '2020-07-22 13:45:41', '2020-07-22 13:46:50', NULL),
(1379, 16, 0, 3, '1378', 'Dr. Oetker FunFoods - Veg Mayonnaise, Original', '250.00', 'Veg Mayonnaise is a FunFoods innovation that was done keeping in view that many Indians are vegetarian. Veg Mayonnaise from FunFoods by Dr Oetker is rich, smooth and creamy. Its neutral and adaptable taste makes it perfect as a core ingredient for a wide array of western dishes such as sandwiches, burgers, wraps and quick white-sauce for macaroni.', '69.00', '65.00', 1, '2020-07-22 13:48:30', '2020-08-26 23:25:37', NULL);
