(1420, 11, 0, 5, '1419', 'Love & Care Fine Cottons Expert Care Wash Liquid Detergent', '950.00', 'Cotton has been cultivated for over 5000 years now and is the most used fibre as compared to other fabrics. Cotton fibres are almost pure cellulose which is most often spun into thread and used to make soft, breathable fabrics. The enzymes in harsh detergents attack the natural cellulose (protein) of cotton causing colour fading, pilling and fuzzing in soft cottons.\r\n\r\nLove & Care is an expert range of fabric wash designed to take care of your special clothes, it is handcrafted to prevent colour fading and pilling of the fine cotton. It is specially designed to keep your fine cottons looking smooth, soft and new for longer. The anti-colour fading formula not only prevents colour bleeding from the fabric but also maintains the brightness of the colours. The anti-pilling formula protects the fabric so that you don’t see any bobbles on your fine cotton clothes. The next time you flaunt your kalamkari or block-printed beautiful Kurti remember to care for it as well with a gentle hand wash ', '300.00', '270.00', 1, '2020-07-22 17:07:35', '2020-07-22 17:07:35', NULL),
