(1564, 14, 0, 10, '1563', 'Bru Gold Coffee 10 N', '10.00', 'Bru Gold offers you an undiluted taste of rich coffee in a convenient manner. It is a perfect blend of high-quality Arabica and Robusta coffee beans that provide you the taste and aroma you look for in your coffee. The coffee is then packed using the latest technology to deliver a mix that retains It\'s qualities for a long time. This coffee powder is also easy to use as it mixes effortlessly with water and milk. This smooth coffee mix is an excellent way to start a fresh day, or catch up on some important moments. Get the Bru Gold Instant Coffee right away, because this richness is what you need in your cup. ABOUT Bru A part of Hindustan Unilever ltd., Bru is India\'s largest and favourite coffee brand that offers a range of coffee products. Since 1968, Bru has constantly endeavoured to bring varied types of authentic coffee with premium tastes to Indian consumers. Highest quality standards mean that we personally select the best coffee beans and perfectly roast them to serve you a grea', '100.00', '100.00', 1, '2020-07-28 21:08:02', '2020-07-28 21:08:02', NULL),
(1565, 14, 0, 10, '1564', 'Red Label Leaf Tea 30 N', '30.00', 'Brooke Bond Red Label is one of India’s largest selling packaged tea brands. Brooke Bond Red Label Tea is a blend CTC tea with best quality leaves; processed in the unique Brooke Bond Tea Excellence Centre .Since 1869, Brooke Bond has brought you the perfect tasting tea experience with the best-chosen leaves. It was in 1903 that Brooke Bond launched “Red Label”. That is when Brooke Bond Red Label started worked to create India’s one of most favourite beverage “chai”. Every cup of Red Label is brewed with the best-chosen tea leaves; that ensure your tea has strength, rich colour, and refreshing taste. We believe our tea has the taste of togetherness that gives that perfect taste, colour and irresistible aroma. Red Label is all about coming together over a warm cup of tea with everyone arounds. It is the “Swad Apnepan ka (Taste of Togetherness). Brooke Bond Red Label stands for inclusiveness and making world a better place one cup at a time.. Enjoy the great tasting range from Red Label', '300.00', '300.00', 1, '2020-07-28 21:10:00', '2020-07-29 19:21:57', NULL),
(1566, 14, 0, 3, '1565', 'Tata Tea Premium.', '500.00', 'Tata Tea is India’s largest packaged tea brand. Today, 1 in every 3 Indian households consumes tea from the brand’s extensive range of variants. With 4 national and 3 regional brands, Tata Tea keeps the diverse preferences of It\'s consumers in mind, offering an eclectic range of flavours and tastes in It\'s portfolio of tea products.', '220.00', '205.00', 1, '2020-07-28 21:11:34', '2020-09-16 18:54:21', NULL),
(1567, 14, 0, 3, '1566', 'Taaza Dust Tea', '250.00', 'Brooke Bond Taaza Tea contains high quality fresh green leaves packed with the natural goodness of Theanine which is one of the best known sources of refreshment that clears your mind instantly. Buy a 1 kg pack of Brooke Bond Taaza Tea, Now.', '80.00', '80.00', 1, '2020-07-28 21:12:18', '2020-07-28 21:12:18', NULL),
