(1570, 14, 0, 3, '1569', 'Cadbury Bournvita 5 Star Magic Chocolate Health Drink Refill', '500.00', 'Bring home the Pack of Cadbury Bournvita 5 Star Magic to feel the magic. Malt food drink fortified with proprietary pro-health bundle (vitamin D, B2, B9, and B12).It can be enjoyed piping hot or deliciously cold. Try blending Bournvita with milk and ice cream to make a chocolate milkshake that is delectable and nutritious.', '218.00', '205.00', 1, '2020-07-28 21:56:34', '2020-09-16 20:25:35', NULL),
(1571, 14, 0, 3, '1570', 'Cadbury Bournvita Health Drink Women, Jar', '400.00', 'Cadbury Bournvita for women with acti Strength Formula is packed with nutrients that is specially designed to meet health needs of women under the age group of 25-45. It has 100 percent RDA of calcium, vitamin D, iron and folic acid for Indian women in the same great Bournvita taste without any added sugar.', '275.00', '275.00', 1, '2020-07-28 21:57:49', '2020-07-28 21:57:49', NULL),
(1572, 15, 0, 3, '1571', 'Nestle Everyday Dairy Creamer Sachet, 120 N', '3.00', 'Nestle Everyday dairy whitener mixes in completely with your tea to lift It\'s taste - so you get a thicker and tastier cup of tea, every time. Did you kNow that everyday is the number 1 selling dairy whitener in the country. It’s No wonder then, that in blind taste tests consumers ranked tea made with everyday as their number 1 choice for a perfect cup of tea. We at Nestle use milk of the highest quality, sourced from well-looked-after cattle that are fed with the right nutrients. We also use our international dairy kNow-how to carefully dry and balance this milk without losing any of It\'s goodness so that you and your family can enjoy a thicker, milkier, tastier cup of tea - with everyday, tea\'s perfect partner serving suggestion: 1 tea spoon plus tea leaves plus 100ml water. Storage: after opening, transfer the contents into an airtight container to avoid lumping. Store in a cool, dry and hygienic place. Safety Warning: this product is not to be used as a mother’s milk substitute.', '295.00', '295.00', 1, '2020-07-28 22:04:20', '2020-07-28 22:04:20', NULL),
(1573, 15, 0, 1, '1572', 'Amul Pizza Cheese Mozzarella', '1.00', 'Amul, which is the largest selling brand of Cheese in India, has introduced genuine Mozzarella Cheese. Amul Pizza Cheese has Moist, Soft, Elastic texture and has a very timely surface sheen and when fresh, it has a slightly salty blandish taste and pleasant aroma. Because of It\'s stretchability, i.e. ability to form strings when hot, this cheese is ideal for preparing Lasagna, and as a topping on pizzas. When baked along with pizzas, it melts uniformly, beautifully engulfing all other ingredients of the pizza surface. Mozzarella is an excellent source of milk proteins, which are palatable. Because of It\'s stretchability, i.e. ability to form strings when hot, this cheese is ideal for preparing Lasagna, Veal Cutlet, Alla Parmagnia and as a topping on pizzas.', '431.00', '431.00', 1, '2020-07-28 22:10:33', '2020-07-28 22:10:33', NULL),
