(2085, 15, 0, 3, '2084', 'Organic Honey Wild Forest', '250.00', 'Organic India Honey Wild Forest is 100 % Natural and Organic Certified and Good for your health. Organic India Wild Forest Honey is smooth, Fragrant, perfectly and irresistibly delicious while being a natural source of Energy. This Golden nectar rich in Wild Forest tastes and aromas is sustainably collected in the Himalayan forest by Apis dorsata laboriosa, the Himalayan honey bee & Apis cerana indica, the Indian honey bee, where flowering trees and plants grow in abundance (and are never sprayed with chemicals). Organic Honey is naturally complete with healthful minerals and nutrients & perfect for adding sweetness to your life by the spoonful, as well as your favorite Tulsi Tea toast & Desserts.', '195.00', '195.00', 1, '2020-08-07 21:31:09', '2020-08-31 18:24:38', NULL),
