(2094, 10, 0, 5, '2093', 'Organic Mustard Oil', '750.00', 'ORGANIC INDIA Mustard Oil - Kachi Ghani\r\nLiving up to our motto of healthy conscious living, ORGANIC INDIA’S certified organic Kachi Ghani Mustard Oil, comes with natural benefits of mustard with highest quality intact in a glass bottle. Our mustard oil naturally contains MUFA, PUFA along with Omega 3 & Omega 6 which are good for your heart health and tastes good as well.\r\n\r\n• Argemone oil free\r\n• USDA Organic certified\r\n• No preservatives', '225.00', '225.00', 1, '2020-08-07 21:54:24', '2020-08-07 21:54:24', NULL),
(2095, 10, 0, 3, '2094', 'Organic Pink Rock Salt Sendha Namak', '100.00', 'ORGANIC INDIA Pink Rock Salt (Sendha Namak) 100g Grinder Bottle. Full of minerals and trace elements including Sodium, Calcium, Magnesium, Potassium, Iron & Phosphorous.\r\n\r\nThis powder is made from the reddish-pink granules of Pink Rock Salt that is all-natural, sourced from Himalayan cli?s, where they have crystallized over millions of years in a pristine and unpolluted environment. ORGANIC INDIA brings to you a healthy choice of salt straight from nature which is 100% authentic and of high quality. It is naturally abundant in essential minerals which provide immense health bene?ts. Pick ORGANIC INDIA Pink Rock Salt Powder for a balanced diet and wellness.', '100.00', '100.00', 1, '2020-08-07 21:56:38', '2020-08-07 21:56:38', NULL);
