(2099, 10, 0, 5, '2098', 'Organic Sesame Oil', '750.00', 'ORGANIC INDIA Sesame Oil - Til Oil\r\nOur Sesame Oil is made from certified organic sesame oilseeds, amongst the oldest oilseeds produced in India. It contains polyunsaturated and monounsaturated fatty acids, Omega 3, Omega 6 and vitamins. Packed in glass bottles, ORGANIC INDIA Sesame Oil has long-lasting aroma and taste. Use it in cooking to uplift your health quotient.\r\n\r\nFree From Argemone Oil\r\nNo Preservatives\r\nUSDA Organic Certified', '400.00', '400.00', 1, '2020-08-07 22:06:30', '2020-08-07 22:06:30', NULL),
(2100, 10, 0, 9, '2099', 'Organic Stevia 25 Sachets Pack of 3', '3.00', 'Organic Stevia 75 Sachets - Organic Stevia can be used for all desserts & Table top applications, Hot and cold beverages like Tea, Coffee Lassi, Nimbu Pani, breakfast cereals.\r\n\r\nWhat is Stevia?\r\n\r\nStevia is a naturally sweet herb belongs to the Chrysanthemum Family. Since ancient times it has been widely used with no side effects.    \r\n\r\nA natural sweetener extracted from the leaves of plant species Stevia rebaudiana. Active compound in Stevia has 200-300 times the sweetness of sugar. One sachet of stevia has sweetness equal to 2 tsp of sugar.', '285.00', '285.00', 1, '2020-08-07 22:08:49', '2020-08-07 22:08:49', NULL),
