(2106, 10, 0, 1, '2105', 'Pink Rock Salt Powder', '1.00', 'ORGANIC INDIA Pink Rock Salt 1Kg Packet (Sendha Namak) Full of minerals and trace elements including Sodium, Calcium, Magnesium, Potassium, Iron & Phosphorous.\r\n\r\nThis powder is made from the reddish-pink granules of Pink Rock Salt that is all-natural, sourced from Himalayan cli?s, where they have crystallized over millions of years in a pristine and unpolluted environment. ORGANIC INDIA brings to you a healthy choice of salt straight from nature which is 100% authentic and of high quality. It is naturally abundant in essential minerals which provide immense health bene?ts. Pick ORGANIC INDIA Pink Rock Salt Powder for a balanced diet and wellness.\r\n\r\nFSSAI Certified & 100% Natural\r\nPRISTINE\r\nUNREFINED\r\nHEALTHY', '140.00', '140.00', 1, '2020-08-07 22:21:25', '2020-08-07 22:21:25', NULL),
(2107, 10, 0, 3, '2106', 'Quinoa', '500.00', 'ORGANIC INDIA Quinoa - Certified Organic Protein Rich Superfood\r\n\r\nORGANIC INDIA Quinoa in india Highly prized as a nutritious food by nutritionists and doctors, Cooked Quinoa (Kinwa) is a favorite because of its great taste, nutritional value, and ease of preparation. Quinoa can be used in place of rice in all your favorite meals.\r\nORGANIC INDIA\'s ethically produced and certified organic Quinoa is grown right here in India', '295.00', '295.00', 1, '2020-08-07 22:28:23', '2020-08-07 22:28:23', NULL),
(2108, 10, 0, 9, '2107', 'REVIVE Fiber Cinnamon Spice 15 packs', '15.00', 'ORGANIC INDIA REVIVE Fiber Cinnamon Spice 15 packs - Promotes Healthy Elimination Helps to Maintain Regularity, Supports Gastrointestinal Health \r\n\r\nREVIVE FIBRE CINNAMON SPICE combines Psyllium, a bulk-forming dietary ?bre, along with other bene?cial herbs including Cinnamon, Clove, and Triphala, to provide a convenient and ?avorful way to get your daily soluble and insoluble ?bre. REVIVE FIBRE CINNAMON SPICE provides an organic source of ?bre that supports the entire gastrointestinal system including supporting healthy elimination and regularity. The soluble ?bre from this formula paired with a healthy diet may also be instrumental to a healthy heart.', '375.00', '375.00', 1, '2020-08-07 22:49:24', '2020-08-07 22:49:24', NULL),
