(2110, 10, 0, 9, '2109', 'REVIVE Fiber Mint 15 packs', '15.00', 'ORGANIC INDIA REVIVE Fiber Mint - Promotes Healthy Elimination Helps to Maintain Regularity, Supports Gastrointestinal Health\r\n\r\nORGANIC INDIA REVIVE FIBRE MINT combines Psyllium, a bulk-forming dietary ?bre, along with other bene?cial herbs including Peppermint, Spearmint and Triphala, to provide a convenient and ?avorful way to get your daily soluble and insoluble ?bre.\r\n\r\nREVIVE FIBRE MINT provides an organic source of ?bre that supports the entire gastrointestinal system including supporting healthy elimination and regularity. The soluble ?bre from this formula paired with a healthy diet may also be instrumental to a healthy heart.', '375.00', '375.00', 1, '2020-08-07 22:52:12', '2020-08-07 22:52:12', NULL),
