(2112, 10, 0, 9, '2111', 'REVIVE Superfood Greens Chlorella 15 packs', '15.00', 'ORGANIC INDIA REVIVE Superfood Greens Chlorella - Boosts Immune Health, Rich in Chlorophyll\r\n\r\nREVIVE SUPERFOOD GREENS CHLORELLA Despite our best intentions, many consumers in India fail to get the recommended ?ve servings of fruits and vegetables per day. REVIVE SUPERFOOD GREENS CHLORELLA provides a remarkably concentrated form of daily nutrition – blending multiple nutritious plants such as Moringa, Wheatgrass, and superfood Chlorella to help you get the daily greens you need to optimize your health and wellness.', '300.00', '300.00', 1, '2020-08-07 23:06:07', '2020-08-07 23:06:07', NULL),
(2113, 10, 0, 9, '2112', 'REVIVE Superfood Greens Original 15 packs', '15.00', 'ORGANIC INDIA REVIVE Superfood Greens Original 15 packs - Boosts Immune Health, Rich in Nutrients\r\n\r\nDespite our best intentions, many consumers in India fail to get the recommended ?ve servings of fruits and vegetables per day. REVIVE Superfood Greens provides a remarkably concentrated form of daily nutrition – blending multiple nutritious plants such as Moringa, Wheatgrass and superfood Spirulina to help you get the daily greens you need to optimize your health and wellness.', '300.00', '300.00', 1, '2020-08-07 23:07:20', '2020-08-07 23:07:20', NULL),
(2114, 10, 0, 3, '2113', 'Saffron Thread kesar', '2.00', 'ORGANIC INDIA Saffron - Kaser, High Grade & 100% Organic Certified is known for influencing mood, heart and respiratory health. Ayurveda also suggests Saffron for sleep disorders, depression, Alzheimer’s disease, hardening of the arteries, intestinal gas, heartburn, pain, fright, dry skin, and to induce sweating. Saffron is known as an aphrodisiac, which can also be used by women for menstrual pains and by men to prevent premature ejaculation and infertility.\r\n\r\nFSSAI - Organic Certified\r\nUSDA - Organic Certified', '899.00', '899.00', 1, '2020-08-07 23:08:48', '2020-08-07 23:08:48', NULL),
(2115, 10, 0, 3, '2114', 'Turmeric Powder 100g Pack of 5', '100.00', 'ORGANIC INDIA Turmeric \'HALDI\' powder has been in use since antiquity for its anti-inflammatory (painkiller), carminative, anti-flatulent and anti-microbial properties. This popular herb contains no cholesterol; however, it is rich in anti-oxidants and dietary fiber, which helps to control blood LDL or \"bad cholesterol\" levels.\r\n\r\nIt is very rich source of many essential vitamins such as pyridoxine (vitamin B6), choline, niacin, and riboflavin, etc. 100 g herb provides 1.80 mg or 138% of daily-recommended levels of pyridoxine. Pyridoxine is employed in the treatment of homocystinuria, sideroblastic anemia and radiation sickness. Niacin helps prevent \"pellagra\" or dermatitis. Rich in calcium, iron, potassium, manganese, copper, zinc, and magnesium.\r\n\r\nFresh root contains very good levels of vitamin-C. 100 of root compose of 23.9 mg of this vitamin. Vitamin C is a water-soluble vitamin and a powerful natural anti-oxidant, which helps the body develop immunity against infectious agents, a', '500.00', '500.00', 1, '2020-08-07 23:10:39', '2020-08-07 23:10:39', NULL),
(2116, 10, 0, 5, '2115', 'Virgin Coconut Oil', '500.00', 'ORGANIC INDIA Virgin Coconut Oil 500 ml\r\n\r\nIs the Highest Quality, Best Tasting, Ultra Healthy and Pure Organic Coconut Oil. A natural super food beneficial for the heart, it also helps in healthy functioning of the thyroid and endocrine systems, and increases the body’s metabolic rate, helping to melt away the extra pounds.\r\nExcellent for cooking as well as for hair and skin care.\r\n\r\nFSSAI, USDA, ORGANIC CERTIFIED\r\nCOLD PRESSED\r\nCENTRIFUGED', '725.00', '725.00', 1, '2020-08-07 23:15:42', '2020-08-07 23:15:42', NULL),
(2117, 12, 0, 5, '2116', 'FOCUS Essential Oil Therapy 9ml Rollon', '9.00', 'ORGANIC INDIA FOCUS Essential Oil Therapy 9ml Rollon - Clarity & Consentration. This roll on is formulated to improve cognition and clarity of mind.Infused with the boosting properties of Bergamot,Rosemary and other Pure essential oils,it helps support memory,recall,focus and concentration.', '345.00', '345.00', 1, '2020-08-07 23:44:34', '2020-08-07 23:44:34', NULL),
(2118, 12, 0, 5, '2117', 'Hair Radiance Oil Jojoba and Amla', '120.00', 'This rich and fragrant herbal oil helps repair and deeply condition dry, damaged, or thin hair. Infused with the replenishing Nila Bhringraj and Pure Essential Oils, and enriched. \r\n\r\nUSP: With regular use of this oil, there is a visible difference in the volume of hair on the scalp. A massage with Bhringraj oil improves blood circulation in the scalp, bringing more nutrients there which help hair grow. Besides, Bhringraj is known to resolve several other hair and scalp issues including dandruff, hair fall, and greying.', '745.00', '745.00', 1, '2020-08-07 23:46:58', '2020-08-07 23:46:58', NULL),
(2119, 14, 0, 4, '2118', 'Organic Ayush KWATH 25 Tea Bags', '25.00', 'ORGANIC INDIA Ayush KWATH - Immunity Booster infusion Bags\r\n\r\nAyush KWATH. A blend of the healing Tulsi, along with Cinnamon, Ginger, and Black Pepper, this formulation is ideal for boosting the immune system.\r\n\r\nCaffeine Free\r\nUSDA Organic Certified\r\nIndia Organic Certified\r\nStaple free tea bags\r\nOur infusion bags are made from unbleached, biodegradable fiber.\r\nThroughout India Tulsi (also known as Holy Basil) is considered “The Queen of Herbs” and is revered as a sacred plant infused with healing powers. Traditionally grown in an earthen pot in every family home or garden, Tulsi’s remarkable life-enhancing qualities, repeatedly noted in ancient Indian scriptures dating back over 5,000 years, are nowhere for you to fully enjoy.', '184.00', '184.00', 1, '2020-08-07 23:49:14', '2020-08-07 23:49:14', NULL),
(2120, 12, 0, 5, '2119', 'Face and Body Mist Frankincense', '100.00', 'This wonderfully fragrant, refreshing and invigorating mist is perfect for everyday use to soothe and replenish your skin and enliven your mood.\r\nUSP: The honey-like, woody notes of frankincense leave you refreshed and it is a known stress-reliever. It also kills harmful germs and bacteria, increasing immunity levels.\r\n\r\nCOSMOS-certified products', '325.00', '325.00', 1, '2020-08-07 23:52:35', '2020-08-07 23:52:35', NULL),
(2121, 12, 0, 5, '2120', 'Face and Body Mist Jasmine Rose', '100.00', 'ORGANIC INDIA Face & Body Mist Jasmine Rose 100ml This beautifully fragrant, refreshing and invigorating mist is perfect for everyday use to revitalise and soothe your skin and enliven your mood. \r\nUSP: A unique combination of two flowers universally hailed for their beautiful perfumes, this face and body mist promises a day of positivity and well-being.', '325.00', '325.00', 1, '2020-08-07 23:54:00', '2020-08-07 23:54:00', NULL),
(2122, 11, 0, 5, '2121', 'Womens Body Oil Revitalising Rose Geranium', '120.00', 'ORGANIC INDIA Body Oil For Women\'s Revitalising Rose Geranium 120ml This rich, nourishing and fragrant oil is specially formulated for Women. Infused with the revitalising and nurturing benefits of Shatavari and Rose Geranium. Prepared with 80 ayurvedic herbs and pure essential oils, this deeply soothing oil helps to enhance mood, relieve stress, revive the body, mind and soul so that you feel refreshed and wonderful, pampered from head to foot.\r\nUSP: Rose Geranium Oil commonly used in aromatherapy can help promote feeling of relaxation and also helps in boosting skin health.', '795.00', '795.00', 1, '2020-08-07 23:56:05', '2020-08-07 23:56:05', NULL),
(2123, 12, 0, 5, '2122', 'Mens Body Oil Energising Ashwagandha', '120.00', 'ORGANIC INDIA Body Oil For Men\'s Energising Ashwagandha 120ml This rich, relaxing and rejuvenating oil specially formulated for Men. Infused with the energising benefits of Ashwagandha. Prepared with more than 75 Ayurvedic herbs and carefully chosen essential oils. This beautifully fragrant oil helps to enhance mood, relieve stress and revitalise body, mind and spirit so that you feel vibrant, uplifted and wonderful all over.\r\nUSP: Translating to “smell of the horse” in Sanskrit, Ashwagandha is an Ayurvedic herb used to relieve stress and improve mental well-being. It also helps in developing body strength.', '795.00', '795.00', 1, '2020-08-07 23:57:33', '2020-08-07 23:57:33', NULL),
(2124, 14, 0, 4, '2123', 'Tulsi Brahmi Tea 25 Tea Bags', '25.00', 'ORGANIC INDIA Tulsi Brahmi 25 Tea Bags - Stress Relieving & Energizing\r\nTwo of India\'s most nourishing herbs, Tulsi & Brahmi, lovingly embrace. This healthful and purifying blend balances your nervous system, offers clarity & calm to your mind and enhances overall physical & emotional well-being.\r\n\r\nAbout Tulsi\r\nThroughout India Tulsi (also known as Holy Basil) is considered “The Queen of Herbs” and is revered as a sacred plant infused with healing powers. Traditionally grown in an earthen pot in every family home or garden, Tulsi’s remarkable life-enhancing qualities, repeatedly noted in ancient Indian scriptures dating back over 5,000 years, are nowhere for you to fully enjoy.\r\nWishing you good health and happiness.\r\n\r\nCaffeine Free\r\n100% Organic Certified\r\nStaple free tea bags\r\nOur infusion bags are made from unbleached, biodegradable fiber.', '154.00', '154.00', 1, '2020-08-10 17:37:53', '2020-08-10 17:37:53', NULL),
(2125, 12, 0, 3, '2124', 'Organic India Moringa Powder', '100.00', 'This is a Vegetarian product.\r\n17 times more calcium than that of milk\r\n25 times more iron than that of Spinach\r\nA rich source of Vitamin C\r\nAn excellent source of Amino acids (Amino acids form proteins)\r\nBoosts overall energy level\r\nIncreases stamina & vitality\r\nNaturally restores essential vitamin & mineral imbalances', '225.00', '225.00', 1, '2020-08-10 17:39:38', '2020-08-10 17:39:38', NULL),
