(2158, 12, 0, 5, '2157', 'Olay Regenerist Revitalising Serum', '50.00', 'Formula helps to- Deliver anti-ageing ingredients into skin’s epidermis layer- Reduce fine line & wrinkle appearance with moisturisation- Exfoliate and smooth skin- PLUS: Hydrates to help plump skinAvoid contact with eyes.', '1096.00', '1096.00', 1, '2020-08-10 21:03:12', '2020-08-10 21:03:12', NULL),
