(2384, 10, 0, 2, '2383', 'Aashirvaad Svasti Cow Ghee', '1.00', 'Aashirvaad Svasti Cow Ghee is excellent for Cooking and also stir-frying. It tastes very natural and good quality.', '660.00', '560.00', 1, '2020-08-21 20:58:33', '2020-08-21 20:58:33', NULL),
(2385, 10, 0, 3, '2384', 'MTR Powder - Turmeric', '100.00', 'MTR turmeric powder is one of the most reliable spices as the powder is extracted from high quality turmeric known as Sangali. They are packed with care so that the spice retains its freshness, colour and flavour till it reaches your home. Turmeric is one of the most-used spices in Indian household, and there is probably no dish that does not contain this spice. Adding this spice to the food gives it a bright yellow colour.', '32.00', '28.00', 1, '2020-08-21 21:01:21', '2020-08-21 21:01:21', NULL),
(2386, 10, 0, 1, '2385', 'India Gate Basmati Rice', '1.00', 'Basmati means \'the queen of smell or the perfumed one\'. India Gate Dubar Basmati Rice is smelled, nutlike flavor and smell can be attributed to the fact that the grain is aged, to reduce its moisture content. When cooked, it swells only sideways, thereby resulting in long slight grains that are dry, divide and fluffy. India Gate Basmati as no other rice in the world has these characteristics in mixture. It has an unforgettable aroma and flavor that will linger in your mind forever.', '115.00', '100.00', 1, '2020-08-21 21:02:54', '2020-09-17 23:35:01', NULL),
(2387, 10, 0, 2, '2386', 'Sundrop Superlite Advanced Oil - Sunflower', '3.00', 'Sundrop Superlite Advanced Oil ensures that the absorption of oil while cooking is less than compared to any ordinary oil. Its advanced refining process makes it extra light, which is enriched with Vitamin A and D that takes care of upto 25% of the daily requirement of essential vitamins. So when you cook food using Sundrop SuperLite Advanced Oil your family eats well and stays active throughout the day. Enjoy this premium oil by Sundrop at super savings with this 3 Litre Jar. Brought to you by Sundrop - Healthy Oil for Healthy People.', '430.00', '430.00', 1, '2020-08-21 21:07:39', '2020-08-21 21:07:39', NULL),
(2388, 10, 0, 2, '2387', 'MTR Powder - Hing', '50.00', 'Asafoetida powder is used commonly in indian cooking for flavoring. It is added in minute quantities as a powder, or when dissolved in water. It is a very strong onion-garlic aroma and is used in small quantities to indian dishes.', '80.00', '64.00', 1, '2020-08-21 21:42:09', '2020-08-21 21:42:09', NULL),
(2389, 10, 0, 3, '2388', 'Catch Powder - Jeera', '100.00', 'Jeera is a tiny grain, filled with lots of flavour and aroma which escapes from the food once it is cooked, to create an appetizing meal. Catch is a well known name in the world of Indian spices and spice mixes. Its Jeera or Cumin Powder is a high quality product.', '52.00', '46.00', 1, '2020-08-21 21:52:24', '2020-08-21 21:52:24', NULL),
(2390, 10, 0, 3, '2389', 'Tata Sampann Powder - Turmeric', '100.00', 'Tata Turmeric Powder Is A Dazzling Yellow Spice Powder Is Prepared From Dry Turmeric Rhizomes. It Is Useful For Its Color, Cosmetic, Flavor And Medical Properties.', '31.00', '29.00', 1, '2020-08-21 21:59:30', '2020-08-21 21:59:30', NULL),
(2391, 10, 0, 3, '2390', 'Everest Chhole Masala', '100.00', 'A wonderful mix of 24 pure spices, this is possibly the mainly elaborate mix in the Everest collection. This mix is equally balanced for flavour and taste and imparts an unusual character to chhole, complete as of chickpeas.', '63.00', '61.00', 1, '2020-08-21 22:05:29', '2020-08-21 22:05:29', NULL),
(2392, 10, 0, 2, '2391', 'Amul High Aroma Cow Ghee', '1.00', 'Amul high aroma cow ghee is made from pure cow milk which has a rich taste and high aroma. From the house of Amul, you can blindly trust on its hygienic aspect. With full of flavours and strong aroma, cow ghee is one of the popular ingredients in many Indian dishes. \r\n\r\nAdd this high aroma cow ghee to your food and multiply the taste manifold.', '560.00', '560.00', 1, '2020-08-21 22:11:54', '2020-08-21 22:11:54', NULL),
(2393, 10, 0, 3, '2392', 'MTR Chilli Powder - Stemless', '200.00', 'Established in 1924, MTR is the contemporary way to authentic tasting food, Our products are backed by culinary expertise honed, over 8 decades of serving wholesome, tasty and high quality vegetarian food, Using authentic Indian recipes, the purest and best quality natural ingredients and traditional methods of preparation, We brings you a range of products of unmatched flavour and taste, to delight your family at every meal and every occasion, MTR Daily Favourites is your dependable partner in the Kitchen that helps you make your family\'s everyday meals tasty and wholesome, So bring home the confidence of great tasting food everyday with MTR..', '75.00', '64.00', 1, '2020-08-21 22:14:18', '2020-08-21 22:14:18', NULL),
(2394, 10, 0, 2, '2393', 'Emami Healthy & Tasty - Rice Bran Oil', '1.00', 'Rice bran oil is extracted from the brown husk, the outer layer of the rice grain is called bran. It has a mild flavour and is neutral in taste. It is notable for its high smoke point and its mild flavor, making it suitable for high-temperature cooking methods such as stir frying and deep frying.', '130.00', '105.00', 1, '2020-08-21 22:15:52', '2020-09-10 23:04:16', NULL),
(2395, 10, 0, 2, '2394', 'Saffola Tasty - Pro Fitness Conscious Edible Oil.', '5.00', 'When you do so much to take care of your family’s fitness, is your oil working hard enough for you? Complement your fitness efforts with healthy choices! Saffola Tasty blended cooking oil absorbs up to 17% lesser fat as compared to other single seed oils, hence making it the right choice of the Fitness Conscious.\r\n\r\nSaffola Tasty, Pro Fitness Conscious Edible Oil brings together the benefits of Losorb & Multiseed technology, which adds back to your health efforts and gives you the best of two oils in one, thus helping you achieve the intake of all kinds of fatty acids like MUFA & PUFA. Saffola Tasty cooking oil is enriched with Vitamin A, D which are good for the Immune system and bone health.', '680.00', '610.00', 1, '2020-08-21 22:22:21', '2020-09-18 20:15:28', NULL),
(2396, 10, 0, 3, '2395', 'Everest Pav Bhaji Masala', '100.00', 'Pav bhaji masala is the blend that took Mumbai by storm. Pav means a bun shaped home made bread. Bhaji means mashed vegetables. • From its humble origins in the by-lanes of Mumbai, it has become a must on menus in 5-STAR restaurants and celebrity weddings. Dished out in the far-flung corners of the country, it has acquired the status of a foremost vegetarian recipe. • Equally popular as a snack or a meal, this easy-to-cook dish enjoys a special place in the hearts of house wives.', '66.00', '60.00', 1, '2020-08-21 22:24:51', '2020-09-04 20:36:23', NULL),
(2397, 10, 0, 3, '2396', 'Aashirvaad Powder - Chilli', '100.00', 'Aashirvaad Chilli Powder is prepared from Red chillies. We decide on chilli the conventional way and they have to be sun-dried, crisp and thoroughly cleaned. Red chilli is the dried ripe fruit of Capsicum frutescent. They are then preferred by experts to ensure that you get chilli powder and it is perfectly matched in taste and colour. It adds a different dimension to the dishes.', '36.00', '24.00', 1, '2020-08-21 22:27:24', '2020-08-21 22:27:24', NULL),
(2398, 10, 0, 3, '2397', 'MTR Masala - Sambar Powder', '100.00', 'Sit back and savour the traditional taste of home-made sambar. All with MTR Foods signature recipe made the authentic South Indian way!\r\n\r\nEstablished in 1924, MTR is the contemporary way to authentic tasting food, Our products are backed by culinary expertise honed, over 8 decades of serving wholesome, tasty and high-quality vegetarian food. Using authentic Indian recipes, the purest and best quality natural ingredients and traditional methods of preparation. We bring you a range of products of unmatched flavour and taste, to delight your family at every meal and every occasion. MTR is your special friend in the kitchen, that helps you bring extra joy to your family\'s everyday celebration with a variety of deliciously tempting food, So make every family occasion a special one, with MTR.', '58.00', '47.00', 1, '2020-08-21 22:31:11', '2020-08-21 22:31:11', NULL),
(2399, 10, 0, 3, '2398', 'MTR Masala - Rasam Powder', '200.00', 'Rasam is a traditional soup that is made and enjoyed in homes across South India. This soup uses a concoction of various spices and red chillies to create a heartening, spicy and light dish. The MTR range of powders, spices and masalas have been known to pack a high-quality punch. The Rasam Powder is one that can be used to make Rasam at the drop of a hat!', '105.00', '96.00', 1, '2020-08-21 22:42:12', '2020-08-21 22:42:12', NULL),
(2400, 10, 0, 3, '2399', 'Everest Kitchen King Masala', '100.00', 'Indian curries are all about imbibing a variety of spices with meat, dal or vegetables for a rich flavour and lots of texture. The spices in Indian cuisine can make or break the dish. Everest understands this and has been busy making spices and spice mixes that can lift any and every dish in Indian cooking. The Everest Kitchen King Masala is a perfect example of this.', '65.00', '58.00', 1, '2020-08-21 23:01:18', '2020-09-04 20:43:07', NULL),
(2401, 10, 0, 3, '2400', 'MTR Masala - Garam', '50.00', 'MTR Garam Masala is a mix of ground spices with alluring aromatic is always helpful to bring good flavor as well as fresh smell to our cuisines. It gives you the best product finished out of fresh and origin ingredients. It keeps a huge impact in the dishes it\'s added. The pungent savor you get after using MTR Garam Masala to your best cooked food. It contains numerous micro nutrients. It has about iron, calcium, zinc and potassium.', '50.00', '45.00', 1, '2020-08-21 23:07:25', '2020-08-21 23:07:25', NULL);
