(2402, 10, 0, 2, '2401', 'Sundrop Oil - Heart', '1.00', 'Sundrop Heart Oil is a perfect blend of refined rice bran oil and refined sunflower oil. This is useful for people who are known to be diagnosed with high cholesterol and high blood pressure.', '210.00', '204.00', 1, '2020-08-21 23:12:50', '2020-08-21 23:12:50', NULL),
(2403, 10, 0, 3, '2402', 'Tata Sampann Fine Besan', '500.00', NULL, '59.00', '55.00', 1, '2020-08-24 17:53:31', '2020-08-24 17:53:31', NULL),
(2404, 10, 0, 3, '2403', 'Nutrela Soya - Granules,', '200.00', 'Soya is a high protein substance that is extracted from an Asian bean bearing plant. It is usually used to replace meat and animal protein for vegetarians. Nutrela is one of the pioneers in the manufacture of Soya Granules that can be used for a variety of dishes that can give you a protein kick which usually comes with meat.', '45.00', '42.00', 1, '2020-08-24 17:56:10', '2020-08-24 17:56:10', NULL),
(2405, 10, 0, 3, '2404', 'Mdh Masala - Kitchen King', '100.00', 'MDH Kitchen King Masala has a combination of coriander, turmeric, cumin, black pepper, chili and other spices. It is dark brown colored, contains a strong spicy taste and should be utilized carefully. Explore the curry experience with this classic mix that provides vegetable curries a lordly flavor and a mild, subdued taste. Being coriander and turmeric based, the mix gives curry a delicious golden hue.', '68.00', '65.00', 1, '2020-08-24 18:00:51', '2020-08-24 18:00:51', NULL),
(2406, 10, 0, 2, '2405', 'Sundrop Heart Oil - Vegetable', '3.00', 'Sundrop Heart is a scientific blend of physically refined rice bran oil (80%) and refined sunflower oil (20%). It is rich in a bio-active component, Oryzanol, that helps reduce cholesterol levels and has been researched and scientifically proven to reduce Cholesterol in 30 Days. Buy Sundrop Heart at a discounted price with this 3 Litre Super Savings Jar. Brought to you by Sundrop - Healthy Oil for Healthy People.', '444.00', '429.00', 1, '2020-08-24 18:04:57', '2020-09-17 23:36:38', NULL),
(2407, 10, 0, 1, '2406', 'Daawat Basmati Rice - Rozana Super90', '5.00', 'Daawat Rozana Super 90 is the finest Basmati Rice in the mid-price affordable segment. It is specially processed for daily cooking across a multitude of regular dishes, a perfect fit for every day consumption. Rozana Super 90 promises a sweet taste and rich aroma as each grain is naturally aged.', '435.00', '389.00', 1, '2020-08-24 18:11:21', '2020-08-24 18:11:21', NULL),
(2408, 10, 0, 3, '2407', 'Mdh Masala - Chana', '100.00', 'MDH Chana Masala is the best ingredient to cook peppery, flavorsome and tasty chana masala. If you desire chana masala to be spicier add extra spices along with MDH Chana Masala. This is an easy recipe for the channa masala powder which is simple to make and tastes remarkable.', '63.00', '60.00', 1, '2020-08-24 18:24:52', '2020-08-24 18:24:52', NULL),
(2409, 10, 0, 2, '2408', 'Sundrop Oil - Gold Lite', '1.00', 'Sundrop Goldlite was launched in 2009 under the fast growing category of blended oils. • Its a scientific blend of Refined Sunflower Oil (60%) and Refined Corn Oil (40% ), Sundrop Goldlite is low in saturated fats which makes it less sticky and light. • It contains Essential Fatty Acids which cannot be synthesized by our body and antioxidants which are known to boost our immune system, which makes it a preferred choice amongst health conscious consumers.', '140.00', '140.00', 1, '2020-08-24 18:29:04', '2020-08-24 18:29:04', NULL),
(2410, 10, 0, 1, '2409', 'Fortune Atta - Chakki Fresh', '5.00', 'Handpicked from Indias finest wheat fields, Fortune Chakki Fresh Atta is made with 100% atta and 0% maida which will complement your daily diet perfectly. These fibre-rich rotis will tingle your senses with their wholesome taste, soft touch and mesmerizing aroma.', '270.00', '237.00', 1, '2020-08-24 18:35:40', '2020-08-24 18:35:40', NULL),
(2411, 10, 0, 3, '2410', 'Everest Powder - Jaljira', '100.00', 'Everest offers Jaljira Powder can be used for preparing beloved welcome drink. A sparkling mix of spices and condiments that contain mint leaf and dry ginger convey a tangy, sizzling nature when mixed with plain water.', '50.00', '45.00', 1, '2020-08-24 18:40:30', '2020-09-10 23:34:28', NULL),
(2412, 10, 0, 3, '2411', 'Nutrela Soya Chunks - Mini', '80.00', 'Soya Chunks are a powerhouse of nutrition. It has high protein content that helps in fighting illnesses and improves the health of women. It reduces the risk of osteoporosis and eases the symptoms. Nutrela chunks are quick and easy to cook. They are made from defatted soy flour. The protein content of soya is equal to that of meat. Soya chunks are a good source of isoflavones.', '15.00', '15.00', 1, '2020-08-24 18:48:20', '2020-08-24 18:48:20', NULL),
(2413, 10, 0, 3, '2412', 'MTR Powder - Black Pepper', '100.00', 'MTR Black Pepper Powder is prepared by picking the pepper berries, which are half-ripe & just about to turn red. These pepper berries are then left to the dry which causes them to shrivel and become dark in color. Commonly, black peppers stimulate the taste bud that alerts the stomach to increase hydrochloric acid secretion, which assists for good digestion.', '165.00', '152.00', 1, '2020-08-24 18:55:29', '2020-08-24 18:55:29', NULL),
(2414, 10, 0, 3, '2413', 'Mdh Masala - Pav Bhaji', '50.00', 'Mdh Pav Bhaji Masala Is Completed With A Well Spice Mix For Vegetables. The Pav Bhaji Masala Is A Mix Of Spices Such As Coriander Seeds, Chilli, Dry Mango Powder, Pepper Etc. That Makes The Flavor Of The Bhaji All The More Exciting. By Adding This Mix In Your Mdh Pavbhaji, You Will Get The Real Flavor Of Mumbai Pavbhaji.', '35.00', '33.00', 1, '2020-08-24 19:01:06', '2020-08-24 19:01:06', NULL),
(2415, 10, 0, 2, '2414', 'Fortune Vivo Pro Sugar Conscious Edible Oil', '3.00', 'A New-age Premium healthy Oil for the whole family, Fortune Vivo caters to the needs of all those who wants to help in managing their Sugar to stay ahead of Diabetes and other related Lifestyle disorders Fortune Vivo which not only helps manage blood sugar levels in Type 2 Diabetics and Pre-diabetics, but can also help in reducing the risk of Diabetes.\r\n\r\nA Unique blend of Physically refined high-quality Rice Bran oil and Premium quality Filtered Sesame oil, Fortune Vivo gives benefits of multi seeds to make it a healthy choice. Healthy oil for the whole family, Fortune Vivo is rich in Natural Anti-oxidants and has a healthy balance of Fatty Acids.\r\n\r\nAfter All, Khane main mithaas bhale hi mana ho, Zindagi Main Mithhas bani rehni chahiye.', '450.00', '405.00', 1, '2020-08-24 19:10:10', '2020-08-24 19:10:10', NULL),
(2416, 10, 0, 3, '2415', 'Tata Sampann Red Rice Poha - Thick,', '500.00', 'Tata Sampann Red Rice Poha (Thick) which is made from the nutritionally rich red rice & Rich in natural trace minerals like potassium, calcium and magnesium. Tata Sampann Red rice is made from Red Rice & Dietary fibre is an essential part of a healthy and balanced diet. Tata Sampann Red Rice poha contains high fibre and is also a source of iron, Iron helps fighting anaemia and in haemoglobin formation.', '70.00', '70.00', 1, '2020-08-24 19:14:55', '2020-08-24 19:14:55', NULL),
(2417, 10, 0, 3, '2416', 'Catch Sambhar Masala', '100.00', 'Catch Sambhar Masala adds the essence of classic South Indian taste to your delicious preparation of Sambhar. Sambhar Masala adds a unique taste, colour and aroma to provide a flavourful bowl of spices South Indian Curry. \r\n\r\nCatch Sambhar Masala has the perfect combination of simple Indian spices grinded at low temperature.', '63.00', '56.00', 1, '2020-08-24 19:29:20', '2020-08-24 19:29:20', NULL),
(2418, 10, 0, 3, '2417', 'Everest Masala - Tandoori', '200.00', 'Everest presents their authentic range of masalas that are blended with a wide variety of handpicked and selected spices that bring a whole new flavour and meaning to your dishes. Rake up your favourite recipes and cuisines by adding this magical blend of Everest masalas.', '143.00', '143.00', 1, '2020-08-24 19:33:18', '2020-08-24 19:33:18', NULL),
(2419, 10, 0, 3, '2418', 'Catch Dry Mango/Amchur Powder', '100.00', 'Catch Amchur is a pure Indian spice commonly used to add tanginess to food. Amchur is a powdered spice made from dry mango pulp. Sourced from the best quality, hand-picked & high acidity content dried mangoes from Raipur, Sambalpur, Jagdalpur & Shakti (Chhattisgarh). This classic Indian spice is one of the many essentials in every kitchen. This staple spice adds a refreshing flavour to both vegetables and meat.', '70.00', '63.00', 1, '2020-08-24 19:43:28', '2020-08-24 19:43:28', NULL),
(2420, 10, 0, 3, '2419', 'Everest Pani Puri Masala', '50.00', 'Pani in Hindi means water. Puri is a fried hollow ball made from wheat flour. The Puri is punctured open on one side and stuffed with delicious fillings and topped with Pani. The Puri is then eaten in a mouth full. This is one of Indias most popular outdoor snacks.\r\nBlack Pepper, Tamarind, and Dry Ginger combine together to give a sharp twinkle to this Everest Blend that spices the Pani.', '31.00', '31.00', 1, '2020-08-24 19:48:33', '2020-08-24 19:48:33', NULL),
(2421, 10, 0, 1, '2420', 'Daawat Basmati Rice - Brown', '5.00', 'It is made using the unique hydration enhancement technology (HET)  which moisturizes the bran layer. This helps water penetrate the grain easily while cooking, so you can  serve wholesome brown rice goodness in just 15 minutes.', '700.00', '688.00', 1, '2020-08-24 19:51:15', '2020-08-24 19:51:15', NULL),
(2422, 10, 0, 1, '2421', 'Pillsbury Atta - Chakki Fresh', '1.00', 'Pillsbury Chakki Fresh Atta Is 100% Complete Wheat Grain Atta With Fibre - Which Is Essential For A Healthy Digestive System - Natural Ingredients For Overall Health And Vitality, Plus Iron, Which Performs As A Carrier Of Oxygen In The Body. The Nutritious Atta Creates Your Cooking Skill A Delight. Since Indian Cooking Use Wheat As One Of Its Main Staple Diets, Pillsbury Chakki Fresh Atta Creates Your Dishes Fresh And Tasty.', '57.00', '55.00', 1, '2020-08-24 20:01:58', '2020-08-24 20:01:58', NULL),
(2423, 10, 0, 3, '2422', 'Catch Sprinklers - Iodised Table Salt', '100.00', 'Catch Sprinklers is a range of dining table condiments that are widely used in India for global cuisines. Catch Table Salt is iodised and vacuum dried enhances the natural taste of all preparations. Catch Table Salt Sprinklers effectively removes the necessity for a salt shaker on your dining table. The unique HIPS container keeps the salt inside dry. Hence, Catch Table Salt does not absorb moisture and remains free-flowing even in the rainy season. Salt is widely used as an additional seasoning agent as it magnifies the taste of all the other spices.', '22.00', '22.00', 1, '2020-08-24 20:14:26', '2020-08-24 20:14:26', NULL),
(2424, 10, 0, 3, '2423', 'Tata Sampann Organic Moong Chilka', '500.00', '100% Organic Pulses from the Tata Sampann sourced from organic certified farms. They are unpolished, have a natural taste and produced without the use of chemical fertilisers and pesticides with an environmentally responsible and sustainable agriculture approach. They are hygienically packed in facility meeting food safety standards and are certified as per the National Programme for Organic Production (NPOP), India. They are also certified as per the National Organic Program (NOP USDA), USA. These pulses are an important source of proteins. They are vegetarian product and can be used in regular recipes.', '127.00', '127.00', 1, '2020-08-24 20:24:52', '2020-08-24 20:24:52', NULL),
(2425, 10, 0, 3, '2424', 'Mdh Masala - Meat', '100.00', 'Meat Masala Is One Such Masala To Arrange The Delectable Tasty Meat. A Pepper-Coriander-Chilli Based Combine That Imparts A Dark Tan And A Hot Taste To Non-Veg Dishes, Particularly Meat. Since Indians Loves Their Meat Actually Spiced Up, A Fair Amount Of Flavoring Spices Lend This Merge A Sweet-Smelling Chorus.', '71.00', '68.00', 1, '2020-08-24 20:29:33', '2020-08-24 20:29:33', NULL),
(2426, 10, 0, 3, '2425', 'Tata Sampann Masala - Dal Tadka', '100.00', 'Daal Tadaka Masala Is An Aromatic Blend Of Spices Extensively Used In Indian Cuisine To Fry Vegitable, Fish And Any Things', '70.00', '59.00', 1, '2020-08-24 20:36:20', '2020-08-24 20:36:20', NULL),
(2427, 10, 0, 2, '2426', 'Emami Healthy & Tasty - Refined Sunflower Oil', '5.00', 'Emami Healthy & Tasty Sunflower Oil is manufactured with Multistage European Refining Technology for highest purity and retention of natural nutrients. This amazing oil contains vitamins and anti-oxidants, which will help your skin and hair. Also, it will lower cholesterol, reduce acne, and reduce the risk of cardiovascular disease.', '685.00', '685.00', 1, '2020-08-24 20:40:00', '2020-08-24 20:40:00', NULL),
(2428, 10, 0, 3, '2427', 'MTR Masala - Chana Masala', '100.00', 'MTR Chana Masala delectably prepared to live up your flavor. Get pleasure from the homely taste hidden within the yummy MTR Chana Masala. It gives you an experience of food which tastes just like clean home cooked food. It is your prepared help in kitchen for genuine taste, variety of choices in dissimilar Indian cuisines and lofty on convenience. Their range now comprises of Soups, Paneer gravies, Vegetable curries and different rice items.', '75.00', '69.00', 1, '2020-08-24 20:44:21', '2020-08-24 20:44:21', NULL),
(2429, 10, 0, 3, '2428', 'Everest Masala - Shahi Biryani', '200.00', 'Everest presents their authentic range of masalas that are blended with a wide variety of handpicked and selected spices that bring a whole new flavour and meaning to your dishes. Rake up your favourite recipes and cuisines by adding this magical blend of Everest masalas.', '240.00', '240.00', 1, '2020-08-24 20:47:14', '2020-08-24 20:47:14', NULL),
(2430, 10, 0, 3, '2429', 'Tata Sampann Organic Brown Chana', '500.00', '100% Organic Pulses from the Tata Sampann sourced from organic certified farms. They are unpolished, have a natural taste and produced without the use of chemical fertilisers and pesticides with an environmentally responsible and sustainable agriculture approach. They are hygienically packed in facility meeting food safety standards and are certified as per the National Programme for Organic Production (NPOP), India. They are also certified as per the National Organic Program (NOP USDA), USA. These pulses are an important source of proteins. They are vegetarian product and can be used in regular recipes.', '89.00', '84.00', 1, '2020-08-24 20:54:29', '2020-08-24 20:54:29', NULL),
(2431, 10, 0, 3, '2430', 'Catch Dal Makhani Masala', '100.00', 'Catch Dal Makhani Masala is one of its own kind in the market. This Indian spice adds a sweet and savoury aroma to the simple black dal. The blended Indian masalas are measured to perfection and grinded at low temperature. Thus, assuring, the perfect combination of various simple Indian spices. This is a Jain product. The net weight of the product is 100 gms.', '60.00', '54.00', 1, '2020-08-24 20:58:52', '2020-08-24 20:58:52', NULL),
