(2486, 14, 0, 3, '2485', 'Bru Instant Coffee.', '25.00', 'Bru Gold Instant Coffee offers you the authentic taste of coffee in its purest form. It is 100% pure coffee from South Indian plantations with the perfect blend of high-quality Arabica and Robusta coffee beans, which are sourced from the finest plantations of South India. The coffee is finely sorted and roasted to perfection to deliver a mix that retains its qualities for a long time. It is also easy to use as it mixes effortlessly with water and milk. This smooth coffee mix is an excellent way to kick start the day. You can now savour every sip to the fullest with Bru Gold 100% pure coffee. Go, get it right away! \r\nABOUT BRU \r\nA part of Hindustan Unilever Ltd. , BRU Coffee is Indias largest and favourite coffee brand that offers a wide variety of coffee products. Since 1968, BRU has been a pioneer in bringing the authentic taste of coffee to Indian consumers. The best coffee beans are selected from across innumerable coffee trails and freshly roasted to serve a great cup of rich, irre', '73.00', '66.00', 1, '2020-08-25 22:43:44', '2020-09-16 19:20:35', NULL),
(2487, 14, 0, 3, '2486', 'Bournvita Health Drink', '75.00', 'Cadbury Bournvita is a delicious chocolate health drink which is enriched with Vitamin (D,B2,B9,B12). It combines the great taste of chocolate, and goodness of essential nutrients that aid growth and development. Bournvita is a malted chocolate drink mix that can be enjoyed piping hot or deliciously cold. Try blending Bournvita with milk and ice cream to make a chocolate milkshake that is delectable and nutritious.', '30.00', '29.00', 1, '2020-08-25 22:54:45', '2020-08-25 22:54:45', NULL),
(2488, 14, 0, 2, '2487', 'Tropicana Delight Fruit Juice - Pineapple', '1.00', 'Enjoy the refreshing and delicious taste of pineapple! A special 6-layer protection gives you the goodness of tasty, ready to serve fruit beverage in every glass of Tropicana. Did You Know? Pineapple is a compound fruit that develops from many small fruits fused together around a central core. It contains an enzyme that is recognized to help in food digestion.', '100.00', '100.00', 1, '2020-08-25 23:15:47', '2020-08-25 23:15:47', NULL),
(2489, 14, 0, 2, '2488', 'Tropicana Delight Fruit Juice - Pomegranate', '1.00', 'Savour the rich taste of pomegranate ! A special 6-layer protection gives you the goodness of tasty, ready to serve fruit beverage in every glass of Tropicana. Did You Know? Pomegranate is a fruit of great antiquity, grown for the last 5000 years in Iran and Afghanistan. A good source of nutrients, this fruit makes for a sweet and great tasting juice.', '110.00', '110.00', 1, '2020-08-25 23:19:07', '2020-08-25 23:19:07', NULL),
(2490, 14, 0, 2, '2489', 'Tropicana Delight Fruit Juice - Cranberry', '2.00', 'Enjoy the refreshing and delicious taste of cranberries! Special 6-layer protection gives you the goodness of tasty, ready to serve fruit beverage in every glass of Tropicana. Did You Know? Cranberry is rich in pigments that add exciting colour to its juice. This makes it a great choice for making blended drinks.', '220.00', '220.00', 1, '2020-08-25 23:20:48', '2020-08-25 23:20:48', NULL),
(2491, 14, 0, 5, '2490', 'Fanta Soft Drink - Orange Flavoured', '300.00', 'Fun, vibrant and bubbly – that’s what defines Fanta best! Fanta lets you make the most of a moment with the tempting taste and its tingling bubbles. This \'orange\' drink entered the Indian market in the year 1993 and has been loved for its bright colour, tempting taste and exciting bubbles. This vibrant soft drink can uplift feelings and help free your spirit, encouraging you to indulge in and enjoy each moment to the fullest. So, grab a Fanta bottle now, and enjoy the great orangey kick in every sip!', '40.00', '36.00', 1, '2020-08-25 23:24:21', '2020-08-25 23:24:21', NULL),
(2492, 14, 0, 3, '2491', 'Red Bull Sugar Free Energy Drink', '1000.00', 'Red Bull Sugarfree gives you wings without sugar and with only 3 calories per 100 ml. With billions of cans consumed all across the world, Red Bull is appreciated by top athletes, busy professionals, college students and travellers on long journeys. Red Bull Sugarfree vitalises body and mind and is for those balancing a busy day of work, at the gym or during fun moments with friends.', '460.00', '460.00', 1, '2020-08-25 23:28:49', '2020-08-25 23:28:49', NULL),
(2493, 13, 0, 3, '2492', 'Parle Glucos Biscuits - Parle-G', '250.00', 'Parle India Has Been The Largest Manufacturer Of Biscuits And Confectionery For Almost 80 Years. Makers Of The World\'S Largest Selling Biscuit, Parle-G, And A Host Of Other Very Popular Brands, The Parle Name Symbolizes Quality, Nutrition And Great Taste. With A Reach Spanning Even To The Remotest Villages Of India, The Company Has Definitely Come A Very Long Way Since Its Inception.', '20.00', '18.00', 1, '2020-08-26 18:53:39', '2020-09-14 21:34:18', NULL),
(2494, 13, 0, 3, '2493', 'Britannia Good Day Cashew Cookies', '200.00', 'Combining the kindness of cookies with the crunchiness and good of cashews, Britannia Good Day rich cashew biscuits will create a delicious blast in your mouth. Great with tea/coffee or on its personal, it makes for a vast bite to share and reach joy.', '40.00', '31.00', 1, '2020-08-26 19:01:17', '2020-08-26 19:01:17', NULL),
(2495, 16, 0, 3, '2494', 'Kelloggs Corn Flakes', '250.00', 'Kelloggs Corn Flakes cereal is a nourishing and wholesome breakfast. It is prepared from actual natural corn, with iron and 8 essential Vitamins containing A, C and B-Group Vitamins, it provides the balanced combination of nourishment and original corn flavour. It is a convenient breakfast option that gives energy even after 3 Hours. Every bite of these crispy, golden flakes is just as delicious as the first. You will be on your way to a great day when you pour Kelloggs Corn Flakes cereal into your breakfast bowl. Grab a pack and kick-start your day with good health and great taste. A quick and convenient breakfast in just 2-3 minutes.', '95.00', '84.00', 1, '2020-08-26 19:11:09', '2020-08-26 19:11:09', NULL),
(2496, 13, 0, 3, '2495', 'Britannia 50-50 Maska Chaska Salted Biscuits', '50.00', 'Britannia 50-50 Maska Chaska Salted Biscuits are prepared with the goodness of butter and peppered with the choicest of herbs. Crunchy and crispy, these biscuits have a light, savoury taste with buttery flavours. Britannia biscuits, cookies, cakes and rusk are a perfect companion for your tea. Believing in delivering fresh and healthy products, Britannia India manufactures some of India\'s favourite brands like Good Day, Tiger, NutriChoice, Bourbon, Milk Bikis and Marie Gold.', '10.00', '9.00', 1, '2020-08-26 19:14:19', '2020-08-26 19:14:19', NULL),
(2497, 13, 0, 3, '2496', 'Kelloggs Almond Corn Flakes', '650.00', 'Kelloggs Corn Flakes with Real Almond is a tasty, nourishing and wholesome breakfast. The goodness of almond inclusions with real honey can be tasted in every bite. Kelloggs Corn Flakes cereal is a nourishing and wholesome breakfast. It is prepared from actual natural corn, with iron and 8 essential Vitamins containing A, C and B-Group Vitamins, it provides a balanced combination of nourishment. Crunchy, lightly sweetened breakfast cereal with almonds and honey in every delicious spoonful, makes this an irresistible breakfast. Do not compromise on morning nourishment when you have a balanced, great-tasting breakfast that is high in Iron, Vitamin B1, B2, B3, B6 and Vitamin C. Kelloggs fortified corn flakes offer a low-fat, nutrient-dense, cholesterol-free food that encourages breakfast consumption.', '360.00', '290.00', 1, '2020-08-26 19:20:39', '2020-08-26 19:20:39', NULL),
(2498, 13, 0, 3, '2497', 'Cadbury Nutties Chocolate Pack', '30.00', 'Enjoy a blend of exotic cashew nuts and cadbury milk chocolate in every bite', '40.00', '40.00', 1, '2020-08-26 19:37:41', '2020-08-26 19:37:41', NULL);
