(2499, 13, 0, 3, '2498', 'Kelloggs Muesli', '750.00', 'Kellogg\'s Muesli with 20% Nuts Delight is an indulgent combination of select ingredients for your discerning palate. Five nutritious grains (Wheat, Oats, Rice, Corn and Barley ) come together with delicious inclusions (raisins and almonds) to give you an unparalleled taste experience. \r\n\r\nA quick, convenient and irresistible breakfast option that provides B group Vitamins (B1, B2, B3, B6 & Folate), Vitamin C, Iron and Fibre for a nourishing start to the day. Naturally cholesterol free breakfast cereal', '415.00', '415.00', 1, '2020-08-26 19:44:42', '2020-08-26 19:44:42', NULL),
(2500, 13, 0, 3, '2499', 'Cadbury Dairy Milk Crackle Chocolate Bar', '36.00', 'Rich, smooth and creamy Classic Milk Chocolate with rice crispies. Every bite is crispier with those little taste explosions in your mouth.', '45.00', '40.00', 1, '2020-08-26 19:49:17', '2020-08-26 19:49:17', NULL),
(2501, 13, 0, 3, '2500', 'Kelloggs Crunchy Granola Almonds and Cranberries', '460.00', 'New Kelloggs Crunchy Granola is an irresistibly tasty way to start your day. Enjoy baked, multigrain clusters of whole-grain oats, wheat, corn, rice and barley, generously loaded with real almonds and cranberries. Have it with milk or as is, for a tasty, nourishing start to your day. Kelloggs Crunchy Granola has 24% Fruit and Nut - it is loaded with yummy cranberries and real almonds to give your day the perfect start. It comes with multigrain goodness and the power of 5 nutritious grains - Oats, Wheat, Corn, Rice and Barley in one delicious breakfast. Kelloggs Crunchy Granola also has the goodness of fibre. It is naturally cholesterol-free.', '315.00', '275.00', 1, '2020-08-26 19:52:53', '2020-08-26 19:52:53', NULL),
(2502, 13, 0, 3, '2501', 'Nestle KitKat 4 Finger Wafer Bar', '37.70', 'Nestle KitKat Wafer Fingers are the ideal snacks for those who really value their break. It’s the ideal treat when you’re enjoying a break, alone or with friends. Just unwrap the bar and break off one of the wafer fingers, snap it into two and savour the deliciously crispy wafers. Enjoying KitKat in your breaks. HAVE A BREAK, HAVE A KitKat. Allergens: May contain Peanuts. Storage: Humidity and temperature may cause the product to develop a whitish layer, this does not affect its fitness for consumption.', '25.00', '23.00', 1, '2020-08-26 20:10:58', '2020-09-07 22:05:30', NULL),
(2503, 16, 0, 3, '2502', 'MTR Elbow Macaroni', '400.00', 'MTR Elbow Macroni is made from 100% suji, for a deliciously delicate and lighter flavour to your Pasta preparations. Delicious pasta made easy and in a jiffy!', '55.00', '55.00', 1, '2020-08-26 20:14:33', '2020-08-26 20:14:33', NULL),
(2504, 13, 0, 3, '2503', 'Parle Krackjack Biscuits', '200.00', 'Parle Krack Jack Biscuit is a crunchy and tasty biscuit with an ideal balance of sweetness and saltiness. Once you begin relishing it, you won\'t be able to end. You will desire for more. Although Krackjack sweet and salty biscuits can be enjoyed anytime, it leaves wonderfully well with your evening cup of tea.', '30.00', '28.00', 1, '2020-08-26 20:37:00', '2020-08-26 20:37:00', NULL),
(2505, 13, 0, 3, '2504', 'Britannia Good Day Butter Cookies', '75.00', 'The all-time favourite, the classic butterlicious flavour of Britannia Good Day cookies only get better with time. The goodness of rich butter melts in mouth effortlessly, giving a cookie that’s loved by everyone. These crumbly cookies are the best partner when you crave munchies between meals. What’s more? It packs in more Good Day Smiles for you Store them in an airtight container and keeps enjoying this yummy indulgence.', '10.00', '9.00', 1, '2020-08-26 20:50:08', '2020-09-14 19:26:44', NULL),
(2506, 16, 0, 3, '2505', 'Chings Sauce - Dark Soy', '750.00', 'Chings Dark Soy Sauce preferred by using a traditional Chinese recipe. Soy beans, salt, sugar fermented to the excellence till the sauce is extracted.', '85.00', '74.00', 1, '2020-08-26 20:53:07', '2020-08-26 20:53:07', NULL),
(2507, 13, 0, 3, '2506', 'Parle Biscuits - Monaco Salted Snack', '66.70', 'Parle Monaco Salted is the perfect accompaniment to a cup of tea, especially for those who are not fond of sweet biscuits. Each biscuit is baked to perfection, is light, crunchy and coated with the adequate quantity of salt so that it can be your favourite mid-morning or evening snack.', '10.00', '9.00', 1, '2020-08-26 21:01:21', '2020-09-14 19:32:14', NULL),
(2508, 16, 0, 3, '2507', 'MAGGI Nutri-licious Atta Masala Noodles', '150.00', 'Maggi masala noodles are loved by India and are here to make your morning worth waking up for. Introducing the new Maggi Nutri-licious Atta Noodles in your favourite masala taste! Maggi Nutri-licious Noodles, a perfect combination of great taste and nutrition, are a balanced way to kickstart your day. Just grab a bowl of Maggi Nutri-licious Noodles, a cup of milk and a fruit and make your mornings nutritiously fun. While research indicates that 25% of urban Indians miss their morning breakfast, you can enjoy Maggi Nutri-licious Atta Noodles every day, which comes bursting with flavour and packed with vegetables. Each portion of the noodles provides you with the fibre of 3 rotis and 15% RDA recommendation of daily protein intake. Just 3 minutes and you have a hot and tasty breakfast ready even on the busiest weekday mornings! It may contain milk solids.', '44.00', '44.00', 1, '2020-08-26 21:09:09', '2020-08-26 21:09:09', NULL),
(2509, 16, 0, 3, '2508', 'Kissan Fresh Tomato Ketchup', '500.00', 'This ones definitely a winner when it comes to cajoling your kids into eating their food. Its remarkable flavour comes from the 100% real juicy tomatoes that have gone in making it. Its an assured hero for all the snacks, be it samosas, pakodas, noodles or plain roti roll - a perfect ally for making wholesome and yummy food. Spread it on a crunchy cracker, roll it up in a roti roll, pour it on a samosa or noodles for your kids tiffin time with an assortment of flavours. So the next time you want to make those greens in your kids plate tolerable, turn to Kissan Tomato Ketchup, secret to empty tiffins! Started in 1934, Kissan is a popular brand in India. Kissan is more than just jams, ketchups, sauces and squashes. Its all about kids eating happily & growing up happily. Kissans tasty and natural goodness keeps both, mothers & kids happy. The brands reassurance to mothers is that they can make tiffin times fun yet wholesome with the Kissan range of products that are made with 100% natural', '99.00', '89.00', 1, '2020-08-26 21:19:29', '2020-09-15 20:50:06', NULL),
(2510, 13, 0, 3, '2509', 'Crax Fritts - Cream & Onion', '41.00', 'Light & Crispy Sticks made from a mouth-watering combination of yummy potatoes & crunchy corns. It’s a non-fried, delicious, anytime snack. Indulge in some great taste alone or enjoy it with your loved ones.', '15.00', '15.00', 1, '2020-08-26 21:58:57', '2020-08-26 21:58:57', NULL),
(2511, 13, 0, 3, '2510', 'Britannia Milk Bikis Milk Cream Biscuits', '100.00', 'Milk Bikis Milky Sandwich biscuits have a tasty, milky filling sandwiched between 2 crunchy shells. Bite into one for a delightful creamy experience. It is rich in protein, calcium, and 4 vital vitamins. Surprise your child with this sweet, crumbly biscuit or munch on it yourself when hunger pangs hit between meals. Store in an airtight container and keep enjoying its crunch.', '10.00', '9.00', 1, '2020-08-26 22:01:58', '2020-09-07 19:27:27', NULL),
(2512, 13, 0, 3, '2511', 'Cadbury Dairy Milk Chocolate', '23.00', 'Cadbury Dairy Milk Chocolate is for those everyday moments of joy that you want to share with your near and dear ones with something sweet. Just one bite will take you into the world of warmth, happiness and spontaneous fun. Rich, smooth and creamy Classic Milk Chocolate which gives you more joy in every bite.', '20.00', '20.00', 1, '2020-08-26 22:09:06', '2020-08-26 22:09:06', NULL),
(2513, 13, 0, 3, '2512', 'Lays Hot & Sweet Chilli', '28.00', 'Experience the dash of sugar & pinch of chilli coming together to give you a distinct Caribbean taste. Delicious individual bags - perfect for snacking at work, home or school. About the brand - Lay’s, the world’s largest and favourite snack food brand, has steadily established itself as an indispensable part of India’s snacking culture since its launch in 1995. \r\n\r\nWith its irresistible taste, international and Indian flavours, Lay’s has established itself as a youth brand and continues to grow in the hearts and minds of its consumers. Lay’s is made with India’s best-quality fresh potatoes, simply sliced and cooked in edible vegetable oils, and then seasoned with delicious flavours!', '10.00', '10.00', 1, '2020-08-26 22:12:02', '2020-08-26 22:12:02', NULL),
(2514, 13, 0, 3, '2513', 'Cadbury Dairy Milk Shots', '18.00', 'Cadbury offers you the best chance to shake your taste buds with the most delicious Cadbury Dairy Milk Shots. The milk consisting chocolate balls encrusted in a hard sugar outer layer doesnt allow you to make an end from having the pleasure of intaking it on and on.', '10.00', '10.00', 1, '2020-08-26 22:29:13', '2020-08-26 22:29:13', NULL),
(2515, 13, 0, 3, '2514', 'Parle Hide & Seek - Chocolate', '200.00', 'First, of its kind chocolate chip cookies in India, Hide & Seek was launched in 1996 – best known today for its rich chocolaty experience.', '60.00', '60.00', 1, '2020-08-26 22:58:01', '2020-08-26 22:58:01', NULL),
(2516, 16, 0, 3, '2515', 'McCain Veggie Burger Patty', '360.00', 'Take a bite of your favourite burger without putting yourself through a drive through. Just bring home this pack of McCain Burger Veggie Patties, a slice of nutritional vegetables in a tasty concoction. This pack of six will keep your burger craving satisfied for a long time', '120.00', '95.00', 1, '2020-08-26 23:04:40', '2020-09-16 21:42:38', NULL),
(2517, 13, 0, 3, '2516', 'Parle Hide & Seek Caffe Mocha Cookies', '120.00', 'Parle Hide and Seek Caffe Mocha biscuits are crispy, sweet and good in taste. Play a game of hide and seek with your taste buds. Feel the extremely delectable taste of Chocolates, comes in a form of choco chips, covering the entire parts of the Parle Hide & Seek Cream biscuits.', '30.00', '30.00', 1, '2020-08-26 23:09:00', '2020-08-26 23:09:00', NULL),
