(2521, 16, 0, 3, '2520', 'Saffola Masala Oats - Masala & Coriander', '38.00', 'Saffola Masala Oats has a burst of flavours and are made from 100% natural wholegrain oats along with real vegetables and the choicest of masalas. Eating Saffola Masala Oats as part of your daily routine is not just fantastically healthy and delicious, but also requires minimal effort for preparation; ready in 3 minutes. It satisfies the cravings for those savoury flavours as a breakfast cereal or during different times of the day.', '15.00', '15.00', 1, '2020-08-26 23:38:54', '2020-08-26 23:38:54', NULL),
(2522, 13, 0, 3, '2521', 'Parle Monaco Cheesling', '300.00', 'Launched in 1942, Monaco pioneered the salted cracker category and is truly an anytime brand. Available in Classic Salted and Zeera flavours.', '120.00', '111.00', 1, '2020-08-28 17:57:36', '2020-08-28 17:57:36', NULL),
(2523, 16, 0, 3, '2522', 'MAGGI Tomato Sauce - No Onion No Garlic', '500.00', 'Nestlé MAGGI rich Tomato Sauces are definitely a household favourite when it comes to persuading your kids to finish their food. The remarkable tomato flavour makes it a hit among the kids and elders alike. The hero to your snacks and the best accompaniment to a boring meal, Nestlé MAGGI Tomato Sauces assure everything from samosas, noodles, pakodas to plain chapatis, is perfect and yummy. For all those who have a ‘no garlic - no onion’ diet, Nestlé brings the scrumptious MAGGI No Onion No Garlic (NONG) Tomato Sauce. It is specially made without the use of Onion or Garlic, yet it is wonderful in taste and can add a unique tang to your usual food.', '105.00', '105.00', 1, '2020-08-28 18:14:26', '2020-08-28 18:14:26', NULL),
(2524, 16, 0, 3, '2523', 'MAGGI Cuppa Noodles - Chilli Chow', '70.00', 'Your on-the-go noodles, Maggi Cuppa offers you the delicious taste of Maggi combined with the convenience of cup noodles! It is an ideal offering for the new generation, pressed hard for time, trying to juggle multiple roles all at once & can be enjoyed anytime on the go. Containing a delicious Chinese masala taste, Maggi Cuppa noodles are made with the finest quality spices and ingredients. The pack comes with Tastemaker already added and a fork inside, for maximum convenience, even on the go.', '45.00', '43.00', 1, '2020-08-28 18:22:26', '2020-09-18 19:11:09', NULL),
(2525, 13, 0, 3, '2524', 'Sunfeast Bounce Biscuits - Elaichi Creme Cookies', '41.00', NULL, '5.00', '5.00', 1, '2020-08-28 18:30:40', '2020-08-28 18:30:40', NULL),
(2526, 16, 0, 3, '2525', 'MAGGI 2-Minute Special Masala Instant Noodles', '840.00', 'To take your favourite Masala taste experience to the next level, MAGGI introduces the New MAGGI Special Masala Noodles, a recipe of 20 Spices and Herbs. Made with a blend of finely ground and whole spices, and herbs, the all-new MAGGI Instant Noodles have a special and flavourful tastemaker sachet inside. These spices have been roasted to perfection, providing a distinct aroma and colour to your MAGGI noodles. Usage Instructions: Prepare a delicious MAGGI in just 2 minutes – Boil 1½ cup of water and add the TASTEMAKER along with the noodle cake broken into 4. Cook for 2 minutes in an open pan, while you stir occasionally. Do not drain the remaining water. Store any remaining MAGGI noodles in an airtight container to retain freshness. S', '180.00', '180.00', 1, '2020-08-28 18:36:58', '2020-08-28 18:36:58', NULL),
(2527, 16, 0, 3, '2526', 'Knorr Chinese Hot & Sour Veg Soup', '43.00', 'Knorr has hand-picked the best quality vegetables and mixed it with spices to make delicious Knorr Hot & Sour Vegetable Soup. Its a little hot, a little sour with the bite of crunchy cabbage, carrot and leeks, giving it its lip smacking taste and perfect consistency everytime. Made with 100% real vegetables and no added preservatives, this soup is ready in three simple steps and serves four. So now enjoy Restaurant like delicious Soup at home.Knorr Soups range comprises of 11 delicious flavours of 4 serve soups and 7 flavours of Cup-a-soup. Great taste is in our Nature! Knorr has gone to great lengths to ensure a perfect blend of ingredients and consistency that give you Restaurant like Soup at home.About Knorr:Just like you, we love everything about food, because no delicious meal is cooked without love. Love for carefully selected ingredients, flavours and spices, or the aroma of dinner wafting through your home. Love for the people you feed everyday; your family and friends, relativ', '55.00', '49.00', 1, '2020-08-28 18:51:48', '2020-08-28 18:51:48', NULL),
(2528, 16, 0, 3, '2527', 'MAGGI Fusian Hong Kong Spicy Garlic Noodles', '73.00', 'Travelling is a great way to discover new flavours, and so is your kitchen, where you can cook and travel the world by means of flavours. Introducing MAGGI Fusian, a range of exciting new flavours that lets you experience unique flavours inspired by the kitchens of Asia, right inside your own kitchen! MAGGI Fusian, available in 3 exciting flavours inspired from the cuisines of Singapore, Bangkok, and Hong Kong, offer new and indulgent taste experiences for the food explorer in you. Try the MAGGI Fusian Spicy Garlic Noodles, inspired by the streets of Hong Kong, an epicentre of food. It is a Fusian of rich Asian spices and mild roasted garlic to create a new taste experience. Try them all and enjoy a thrilling Asian feast with friends and family, or simply treat yourself to new food experience with MAGGI Fusian Singaporean Tangy Pepper Noodles.', '20.00', '20.00', 1, '2020-08-28 19:03:24', '2020-08-28 19:03:24', NULL),
(2529, 16, 0, 3, '2528', 'MTR', '500.00', 'Established in 1924, MTR is the contemporary way to authentic tasting food, Our products are backed by culinary expertise honed, over 8 decades of serving wholesome, tasty and high quality vegetarian food, Using authentic Indian recipes, the purest and best quality natural ingredients and traditional methods of preparation, We brings you a range of products of unmatched flavour and taste, to delight your family at every meal and every occasion, MTR Daily Favourites is your dependable partner in the Kitchen that helps you make your family\'s everyday meals tasty and wholesome, So bring home the confidence of great tasting food everyday with MTR..', '110.00', '110.00', 1, '2020-08-28 19:07:31', '2020-08-28 19:07:31', NULL),
