(2576, 12, 0, 2, '2575', 'Dettol Original Germ Protection Alcohol Based Hand Sanitizer Refill', '5.00', 'Your Trusted Dettol offers a new and improved Dettol Hand Sanitiser that is rinsed free and non-sticky. It has an enhanced fragrance with better coverage. It is specially formulated to protect you from 100 illness-causing germs. With an easy application drop bottle, you can protect yourself and your family from a wide range of illness-causing germs anytime, anywhere without soap or water. Keeping germs at bay with Dettol’s on-the-go instant hand sanitiser packs is easy. It is, in addition, enriched with Moisturisers that doesn’t let your hands dry up and leave them 99.9 per cent germ-free. These sanitiser bottles are convenient to carry and can be placed anywhere from your pocket, purse or bag for on-the-go convenience. Dettol Instant Hand Sanitisers are perfect for the season of sneezes and sniffles, winters! the time when playtime turns into snack-time when the crowd is unavoidable and the food too the time when you plan to have dinner on the mid-trip when cough should not be stoppin', '2500.00', '2500.00', 1, '2020-09-01 18:18:35', '2020-09-01 18:18:35', NULL),
