(2579, 12, 0, 2, '2578', 'TRESemme Keratin Smooth Shampoo', '1.00', 'Launched in 1948, Tresemme was named after renowned hair care expert Edna Emme. Up until the 1950s, Tresemme was sold only in salons. Today it is available at a shop near you so that you can have salon-style hair at home. For over 60 years, Tresemme has built a history of success in 13 countries around the world. From its origins in 1947 and salon expertise, Tresemme has been driven by a simple truth: every woman deserves to look & feel fabulous like she has just stepped out of the salon, every day. \r\n\r\nThis range has been carefully selected for its advanced formula. Driven by our salon heritage, we work with our stylists to deliver expert solutions from salon quality products without the salon price tag. Our salon-inspired products enriched with high-quality ingredients that help you experience that salon feeling, every day. \r\n\r\nSpecially formulated with lower sulfates, Tresemme Keratin Smooth Shampoo helps restore keratin and nourishes each strand to leave hair gorgeously straighter,', '580.00', '464.00', 1, '2020-09-01 18:47:18', '2020-09-01 18:47:18', NULL),
(2580, 12, 0, 5, '2579', 'Nivea Body Lotion - Nourishing Body Milk, For Very Dry Skin', '400.00', 'Cold weather, air-conditioned areas, too much time in the sun or even harsh soaps are just a few of the reasons that cause your skin to become itchy, scratchy and really dry. \r\n\r\nWouldn’t it be great if there was a body lotion that provided daily nourishment for your very dry skin all day, round the clock? With the goodness of almond oil, Nivea Nourishing Body Milk instantly alleviates dry skin, and keeps the skin moisturised for 24 hours with just one use! \r\n\r\nThis rich nourishing milk is the original Nivea Body Lotion, first formulated as \'liquid crème\' in 1961. With an iconic fragrance, this body milk intensively nourishes extremely dry skin, leaving it soft and healthy. Use it after a shower and before going to bed to get a nourished, healthy-looking skin. \r\n\r\nThe Nivea Nourishing Body Milk is free of animal-derived ingredients and colourants. It is dermatologically approved and suitable for extremely dry skin.', '349.00', '296.00', 1, '2020-09-01 18:50:02', '2020-09-01 18:50:02', NULL),
(2581, 12, 0, 5, '2580', 'Himalaya Wellness Hand Sanitizer - Pure Hands', '100.00', 'Himalaya Hand Sanitizer Pure Hands: Effective against bacteria, fungi and germs, No Soap & water required after use, Recommended & used by doctor.', '50.00', '50.00', 1, '2020-09-01 18:58:20', '2020-09-01 18:58:20', NULL);
