(2582, 12, 0, 4, '2581', 'Veet Hair Removal Waxing Strips Kit - Sensitive Skin, 20 Strips', '20.00', 'Veet Ready-to-Use Wax Strips are a perfect solution when going to the parlour is not an option. It effectively pulls out as short as 1.5mm short hair, giving you up to 4 weeks of lasting smoothness and instantly exfoliated skin, whenever you want. And they\'re easy to use, any time. These waxing strips, as the name suggests are great for instant use and does not require heating, which means, no mess!\r\n\r\nDead skin cells tend to accumulate on our skin surface regularly, making it necessary for us to wax and remove not just the hair but dead cells that make the skin look dull and dry. Veet ready-to-use wax strips can help exfoliate the skin while it also removes hair just perfectly. It comes with an easy grip tab that makes the waxing process quicker and simpler. Specially formulated with Almond Oil and Vitamin E, this variant takes extra care to suit your sensitive skin', '190.00', '180.00', 1, '2020-09-01 19:16:07', '2020-09-01 19:16:07', NULL),
