(2584, 12, 0, 3, '2583', 'Sensodyne Sensitive Toothpaste  Fresh Mint', '75.00', 'Sensodyne toothpaste provides clinically proven relief and daily protection for sensitive teeth. Sensodyne relieves sensitivity by building a protective barrier that blocks the sensitivity caused by hot, cold, sweet and other contact triggers. It contains fluoride to prevent cavities so that you can use it every day. Toothpaste has a cool refreshing taste that leaves your mouth feeling fresh and clean. For best results, use twice daily', '110.00', '103.00', 1, '2020-09-01 19:26:35', '2020-09-01 19:26:35', NULL),
