(2587, 12, 0, 5, '2586', 'Colgate Mouthwash - Plax, Peppermint Fresh', '500.00', 'Protect your mouth from germs and get fresh breath every morning with Colgate Plax Peppermint Fresh Mouthwash which gives 10x longer cooling sensation. It removes over 99% of bad breath causing germs in your mouth, for a fresher and cleaner mouth than brushing alone. Colgate Plax Peppermint Fresh Mouthwash contains a strong Peppermint flavour that gives a boost of confidence with every use. It is Alcohol-free so you experience no burning sensation, just fresher smiles between brushings!Make Colgate Plax a part of your daily oral hygiene. Use it twice a day after brushing, for a cleaner, fresher and healthier mouth. When used as directed, Colgate Plax mouthwash can also help prevent cavities, protect against germ build-up and provide healthier gums vs. non-antiseptic mouthwash, when used as directed.', '230.00', '207.00', 1, '2020-09-01 19:41:22', '2020-09-01 19:41:22', NULL),
