(2590, 12, 0, 5, '2589', 'Dabur Sanitize Hand Sanitizer - 60% Alcohol Based Sanitizer, Lemon,', '500.00', 'India\'s most trusted Ayurvedic brand offers a new range of hand sanitizers - Dabur Sanitize - kills 99.9% germs without the use of soap & water. It is recommended for regular hand cleaning inside your home, office and in public places, especially before consuming food & eatables and after coming in contact with any external surface, pet or a person. It\'s recommended since germs spread through coughing and sneezing. \r\n\r\nRecent evidence has shown that some germs linger on surfaces like doorknobs, desks and phones, and are transferred via the fingers to the mouth, nose or eyes. Sanitizing your hands with Dabur Sanitize protects you from the germs transferred from direct contact with an infected person or from an external source. Available in 3 fragrances“ Regular, Strawberry and Lemon.', '250.00', '225.00', 1, '2020-09-01 19:56:04', '2020-09-01 19:56:04', NULL),
