(2593, 12, 0, 3, '2592', 'Close Up Everfresh+ Anti-Germ Gel Toothpaste - Red Hot,', '150.00', 'Do you brush your teeth hurriedly? Do you often forget to use mouthwash or not use it at all? Are your teeth dull and covered with a yellowish coating of plaque? Do u have bad breath? If your answer to the above questions is yes then Closeup Everfresh+ Gel Toothpaste is for you! Bad breath is a common condition that affects many people and has health as well as social implications. It can be caused by the millions of bacteria that live in your mouth. If you don\'t brush, floss and use mouthwash every day, plaque germs can form resulting in bad breath. Closeup Everfresh+ Gel Toothpaste now in Triple Fresh Formula harnesses the combined power of 3 components – Anti-bacterial mouthwash, Purifying Gel and Natural Extracts of Tea Tree and Eucalyptus to keep your mouth clean, protected and fresh. It is infused with Anti-bacterial mouthwash formula with active zinc that fights up to 99% of germs. So kiss goodbye to bad breath and say hello to longer-lasting fresh breath for up to 12 hours*. It', '85.00', '72.00', 1, '2020-09-01 20:06:31', '2020-09-01 20:06:31', NULL),
