(2596, 12, 0, 3, '2595', 'Dove Go Fresh Moisture Bathing Bar Soap', '75.00', 'Dove Fresh Moisture Beauty Bathing Bar combines the refreshing scent of cucumber and green tea with Doves gentle cleansers and 1/4 moisturizing cream. Unlike normal soap bars, which can leave skin dry and tight, Dove protects skins natural moisture for softer, smoother skin. It can be used on your hands and as a mild facial cleanser, so if youre also after a fresh face and refreshingly hydrated hands throughout the day, why not try adding Dove Beauty Bar Go Fresh Cucumber and Green Tea to your skin care routine? Light, hydrating feel and refreshing formula that effectively nourishes skin A refreshing shower can be just what you need to start the day off right. Doves Go Fresh range blends nourishing Ingredients and light, fresh scents in a formula thats gentle on your skin. Dove Go Fresh beauty bars give you a feeling of hydrating freshness that leaves you and your skin feeling blissfully revived. Dove is the No.1 Brand recommended by dermatologists in India. For best results: Your hand', '49.00', '49.00', 1, '2020-09-01 20:17:28', '2020-09-01 20:17:28', NULL),
