(2598, 12, 0, 3, '2597', 'Himalaya Bathing Soap - Cucumber & Coconut', '300.00', 'Himalaya Herbals Refreshing Cucumber Soap is enriched with extracts of nut grass that sooth and moisturize the skin. It has turmeric which keeps the skin due to its antibacterial activities. The Cucumber sooth, rinse and energize and Oil of Coconut nourishes and moisturizes skin.', '120.00', '103.00', 1, '2020-09-01 20:28:29', '2020-09-01 20:28:29', NULL),
(2599, 12, 0, 5, '2598', 'Himalaya Purifying Neem Face Wash', '300.00', 'Himalaya Purifying Neem Face Wash is a soap-free, herbal formulation that cleans impurities and helps clear pimples. A natural blend of Neem and Turmeric bring together their antibacterial and antifungal properties to prevent the recurrence of acne over time. \r\n\r\nNeem is an excellent skin care ingredient known for its antibacterial properties. It improves general skin health and immunity, combating bacterial infections such as acne, boils, and ulcers. Neem tackles bacteria from the root and prevents the recurrence of pimples and blemishes. \r\n\r\nTurmeric has been used as an antiseptic for centuries, and it is regarded as one of the natures most powerful healers. The herb helps to even out your skin tone and colour, making it an excellent ingredient in a face wash. Turmeric has strong anti-inflammatory properties, which soothe your skin.', '270.00', '206.00', 1, '2020-09-01 20:30:29', '2020-09-01 20:30:29', NULL),
