(2603, 12, 0, 3, '2602', 'Ponds Dreamflower Fragrant Talc', '400.00', 'We often wonder if there is a product that could help us retain the shower like freshness throughout the day ! Get that instant burst of freshness after a shower with Ponds Dreamflower Freshness Acacia Honey talc that will keep you rejuvenated & fresh for long hours. Infused with fragrance of Acacia Honey which is known for its skin care benefits, Ponds Dreamflower Freshness Acacia Honey talc - gives you soft & smooth skin throughout the day. Perfect for the summers, Suitable for both men and women, it helps you to stay refreshed to make you smell & feel beautiful. Talc, the main ingredient, is one of the softest mineral, with fine texture - found in nature, and helps to absorb the sweat. Use generously on your body to absorb sweat, fight body odour and bacteria and powder your face for smoother and brighter skin. Ponds Dreamflower talc comes in a vibrant pack with twist-lock button for quick and easy dispensing. This is new & improved formula that works for giving you fragrance and lo', '280.00', '252.00', 1, '2020-09-01 20:47:19', '2020-09-01 20:47:19', NULL),
