(2610, 12, 0, 5, '2609', 'Nivea Men Shower Gel - Pure Impact Body Wash, Men', '500.00', 'For men who want that deep cleansing effect, the innovative 3-in-1 formula for body, face and hair with extra fine scrub particles deeply cleanses and moisturizes to provide long-lasting freshness that leaves you feeling revitalised and rehydrated.', '399.00', '319.00', 1, '2020-09-01 22:24:42', '2020-09-01 22:24:42', NULL),
(2611, 12, 0, 3, '2610', 'Dabur Chyawanprakash - Sugar free', '900.00', 'Dabur Chyawanprakash Sugar Free is unlike other typical nutrition supplements: its a specialised immune system booster thats made to ensure that no one gets left out. If youre avoiding sugar for any reason at all, you can still protect yourself from day-to-day infections like cough & cold.', '355.00', '319.00', 1, '2020-09-01 22:28:46', '2020-09-01 22:28:46', NULL),
(2612, 12, 0, 3, '2611', 'Eno Fruit Salt - Lemon Flavor', '100.00', 'ENO gets to work in 6 seconds to neutralize acid in your stomach, on contact. ENO Powder gets to work faster than liquid and tablet antacids, so that you get fast relief when you need it most. India\'s No 1 Antacid brand.', '120.00', '112.00', 1, '2020-09-01 22:35:15', '2020-09-01 22:35:15', NULL),
(2613, 12, 0, 5, '2612', 'Nivea Deodorant - Fresh Active', '150.00', 'A long day needs long-lasting freshness. Here’s a men’s deodorant that helps keep the freshness, the suave man’s poise, and confidence intact all day long. Designed with a special formula enriched with Ocean Extracts, this deodorant not only appeals to the senses but also keeps body odour in check for all your daily rigorous tasks.', '210.00', '179.00', 1, '2020-09-01 22:40:45', '2020-09-08 23:01:31', NULL),
(2614, 12, 0, 5, '2613', 'Nivea Aloe Protection SPF 15 Body Lotion', '200.00', 'Gift your skin The goodness of Nivea aloe protect body lotion SPF 15 for all day long smooth skin. Enriched with aloe vera extracts, it soothes dry and irritated skin and leaves you with comfortable, soft skin.', '275.00', '247.00', 1, '2020-09-01 22:49:31', '2020-09-01 22:49:31', NULL),
(2615, 12, 0, 5, '2614', 'Nivea Lemon & Oil Shower Gel', '500.00', 'Give your skin refreshing care with Nivea lemon and oil shower gel. Enriched with care oil pearls that moisturize your skin, making it soft and supple. Let this fresh shower gel envelop your skin with a silky soft foam, while its invigorating scent of lemon stimulates your senses.', '399.00', '299.00', 1, '2020-09-01 22:51:37', '2020-09-01 22:51:37', NULL),
(2616, 12, 0, 5, '2615', 'Nivea Frangipani & Oil Shower Gel', '500.00', 'Give your skin refreshing care with Nivea frangipani and oil shower gel. Enriched with care oil pearls that moisturize your skin, making it soft and supple. Let this fresh shower gel envelop your skin with a silky soft foam, while its invigorating scent of frangipani stimulates your senses.', '399.00', '299.00', 1, '2020-09-01 22:52:38', '2020-09-01 22:52:38', NULL),
(2617, 12, 0, 2, '2616', 'TRESemme Smooth & Shine Shampoo', '1.00', 'Launched in 1948, TRESemmé was named after renowned hair care expert Edna Emmé. Up until the 1950s, TRESemmé was sold only in salons. Today it is available at a shop near you so that you can have salon-style hair at home. For over 60 years, TRESemmé has built a history of success in 13 countries around the world. From its origins in 1947 and salon expertise, TRESemme has been driven by a simple truth: every woman deserves to look & feel fabulous like she has just stepped out of the salon, every day. This range has been carefully selected for its advanced formula.\r\n\r\nDriven by our salon heritage, we work with our stylists to deliver expert solutions from salon-quality products without the salon price tag. Our salon-inspired products enriched with high-quality ingredients help you experience that salon feeling, every day. With Vitamin H and silk protein, TRESemme Smooth & Shine conditioner provides intense moisturisation for salon smooth silky hair. It has an advanced smoothing system th', '525.00', '420.00', 1, '2020-09-01 22:55:29', '2020-09-01 22:55:29', NULL),
(2618, 12, 0, 5, '2617', 'Dove Anti-Dandruff Solutions - Dandruff Clean & Fresh Shampoo', '340.00', 'At Dove, we are dedicated to providing superior nourishment solutions for hair. The Dove Anti-Dandruff solutions range has been specially designed to give your hair the superior care it needs. It has been carefully created to be clinically effective against dandruff, while still being gentle on your hair so that you can use it every day. All that sweat and dust leaving your scalp feeling itchy? When white flakes appear, all we want to know is how to clear them – and quickly. Now say \'bye\' to dandruff flakes and that itchy feeling with New Dove Dandruff Clean & Fresh shampoo. This shampoo removes dandruff from your scalp and also gives a cool & fresh sensation. Dove Dandruff Clean & Fresh nourishes your hair from roots up, giving you hair that’s 100% smoother* and up to 100% free of dandruff. Its ZPTO formula is clinically proven to target dandruff at its source and start clearing flakes from the first wash itself. It also has menthol that gives a burst of freshness and Micro Moisture S', '275.00', '261.00', 1, '2020-09-02 18:08:55', '2020-09-02 18:08:55', NULL),
(2619, 12, 0, 5, '2618', 'Savlon Clear Ethanol Disinfectant Hand Sanitiser Gel', '200.00', 'Savlon’s Hand Sanitiser has a high effectiveness quotient and is available in multiple formats. This 100 ml Pack is ideal for on the go sanitizer usage requirements. The Sanitiser comes in a convenient pack and can be stored easily in a bag/purse. Apply on your palms and spread until dry. Savlon Hand Sanitiser Helps break the chain of infection by protecting against a wide range of germs like bacteria, fungi, moulds.', '100.00', '100.00', 1, '2020-09-02 18:26:21', '2020-09-02 18:26:21', NULL),
(2620, 12, 0, 3, '2619', 'Dettol & Moms - Citrus Soap,', '75.00', 'Your Trusted Dettol offers a new range of Dettol Co-Created with Moms beauty bathing soaps. It is made by ingredients approved by moms and with minimal chemicals. This new range is free from parabens, harsh chemical residues, artificial dyes, and talc; it has fragrance infused with 100% natural citrus essence. It gives 10 times better protection than any ordinary soap and is gentle on skin. Reassuringly, Dettol protects from a wide range of illness-causing germs and bacteria to help you stay healthy.', '120.00', '120.00', 1, '2020-09-02 18:29:21', '2020-09-02 18:29:21', NULL),
(2621, 12, 0, 3, '2620', 'Nivea Purifying Face Wash', '150.00', 'Put your best face forward, with Nivea Purifying Face Wash. Its microbead formula containing ocean algae extracts and hydra IQ deeply cleanses your pores and reduces excess sebum. It also vitalizes the skin making it look pure and clear.', '175.00', '175.00', 1, '2020-09-02 18:34:07', '2020-09-02 18:34:07', NULL),
(2622, 12, 0, 5, '2621', 'Godrej Expert Easy 5 Minute Hair Colour - Natural Black, 25 ml (Pack of 3)', '25.00', 'Godrej Expert Easy 5 Minute Hair Colour is a modern and convenient way of hair colouring. It is enriched with the goodness of Amla and Shikakai. Hair colour with 100% grey coverage and no Ammonia formula. A quick and convenient way of hair colouring without using a brush or bowl and no mixing. Apply the colour on washed and completely dried hair and rinse off. Also available in two other variants, Natural Brown and Burgundy.', '120.00', '120.00', 1, '2020-09-02 18:42:32', '2020-09-02 18:42:32', NULL),
(2623, 22, 0, 5, '2622', 'Godrej Aer Fabric Sanitizer Spray - 99.9% Germ Protection, Long Lasting Fragrance, Cool Surf Blue', '225.00', 'Aer fabric sanitizer spray is a unique 2-in-1 combination of amazing freshness and protection against germs on fabrics. Use Aer fabric sanitiser on your curtains, sofa, cushions, bedsheets, towels etc to keep them fresh smelling, safe and free from germs', '199.00', '169.00', 1, '2020-09-02 18:58:43', '2020-09-02 18:58:43', NULL),
(2624, 12, 0, 5, '2623', 'Santoor Hand Wash - Mild, 2 x 215 ml Multipack', '430.00', 'Santoor Mild Handwash enriched with the natural goodness of Lotus and Tulsi offers the unique dual benefit of “Tough on Germs and Soft on Hands”.\r\n\r\nIts unique formulation not only fights germs but has a pH balanced formulation that maintains the softness of the hands soft on hands, not on germs Active ingredients that effectively protects from germs.', '140.00', '119.00', 1, '2020-09-02 19:01:35', '2020-09-02 19:01:35', NULL),
(2625, 22, 0, 3, '2624', 'Vim Dishwash Bar - Lemon', '85.00', 'Vim Dishwash Bar is enriched with the power of lemons that makes lubricant vanish which works brilliantly for sink and kitchen surfaces too while leaving the kitchen smelling fresh. It also uses other natural products to maximize the results, and minimize the use of chemicals. The finest part is a little goes a long way when you keep off water.', '5.00', '5.00', 1, '2020-09-02 19:13:59', '2020-09-02 19:13:59', NULL),
(2626, 22, 0, 3, '2625', 'Surf Excel Detergent Bar', '200.00', 'Surf excel detergent bar is Indias most premium detergent bar and is developed with a unique patented technology. Surf excel bar combines the power of 4 products - vinegar, blue, bleach and lemon into just 1 product, thereby helping you fight and remove tough stains easily that help you save time, money andÃƒ€šÃ‚  effort you put behind laundry. With just one product, Surf Excel Bar, you can easily remove tough stains like tea, coffee, turmeric, curry, ketchup and chocolate. Besides the 95g pack, Surf Excel Bar is also available across other convenient pack sizes such as 150g, 250g, 400g & 800g (4packs of 200g each). All you need to do is apply the bar on the tough stains, scrub a little and then wash the garment as usual and voila, you have spotless clean clothes. Unlike most popular based brands, the effort required when using Surf Excel Bar is far lesser and makes your laundry process a less tedious chore. It is gentle on both your clothes and your hands. Surf Excel Bar removes tough', '94.00', '86.00', 1, '2020-09-02 19:21:23', '2020-09-02 19:21:23', NULL),
(2627, 22, 0, 3, '2626', 'Rin Detergent Bar', '140.00', 'Presenting the new Rin Bar, with the promise of whiter and brighter clothes so that you can dress to progress! As you stride forward on your journey through life, Rin Bar gives you the confidence to shine, all day, every day. Rin Bar removes the dirt from the toughest places like cuff and colour with just one stroke. It also leaves your clothes with a pleasant fragrance to keep you feeling fresh all day long. With Rin Bar by your side, let your confidence shine as bright as your clothes do!\r\n\r\nRin Detergent Bar is extremely easy to use. Washing Instructions for Bright Clothes? Soak clothes in a bucket of water? Use Rin Bar directly on dirt areas, one stroke is enough? Use a scrubber to remove tougher dirt Rin Bar is available in convenient pack sizes of Rs. 5, Rs. 10, 250 g and 1000 g (4 packs of 250 g each). Rin Bar is here to help you achieve the all-round cleanliness your clothes need to shine bright. So what are you waiting for! Try the new Rin Bar to make clothes shine like new. S', '10.00', '9.00', 1, '2020-09-02 19:25:11', '2020-09-02 19:25:11', NULL),
(2628, 22, 0, 4, '2627', 'Scotch brite Steel Scrubber Combo, 3x1 pc Multipack', '3.00', 'Steel Combi has one steel scrub, it comes with a free Scotch-Brite Scrub pad worth Rs.10. It is an ideal tool for daily cleaning needs and tough stains.', '105.00', '87.00', 1, '2020-09-02 19:31:08', '2020-09-02 19:31:08', NULL),
(2629, 22, 0, 4, '2628', 'Scotch brite Sponge Wipe Large', '3.00', 'The Sponge Wipe is a one swipe cleaner for kitchen counter tops, tables, and other kitchen appliances. \r\nThe kitchen surfaces and dining table are all spaces that are most susceptible to spills and cleaning them is a mess. Sponge Wipe from Scotch-Brite is all it takes to keep them mess-free in a single swipe!\r\n\r\nThis brilliant offering from Scotch-Brite cleans any mess in a single swipe without leaving behind water-marks. It is multi-purpose and does a great job while also being economical. \r\n\r\nThe Sponge Wipe can be washed and used several times providing real value-for-money.', '195.00', '180.00', 1, '2020-09-02 19:38:08', '2020-09-02 19:38:08', NULL),
(2630, 22, 0, 3, '2629', 'Tide Plus Detergent Washing Powder - Extra Power Jasmine & Rose', '500.00', 'New Tide + with Extra Power detergent, now with the added Power of Bar, has been developed to bring you brilliant whiteness on your clothes. It removes dirt even from washed clothes to give you even better cleaning. The enzyme formula in the washing powder helps in washing away the toughest stains on the clothes, thus making them look bright and fresh. Kids often soil their clothes, especially school uniforms, with tough-to-remove stains and dirt. Tide + with Extra Power is a fine detergent powder which dissolves easily in water and quickly generates foam. The superior formulation can remove dirt even from difficult-to-clean areas like collars and cuffs, and leaves behind a wonderful fragrance. The product works on both white and colored clothes. Extra Power refers to vs previous Tide Plus. Tide, a unit of Procter & Gamble, is the Worlds Oldest & Most Trusted Detergent brand and is the Market Leader in 23 Countries around the world.', '55.00', '48.00', 1, '2020-09-02 19:42:58', '2020-09-02 19:42:58', NULL),
(2631, 22, 0, 5, '2630', 'Lizol Disinfectant Surface & Floor Cleaner Liquid - Lavender, Kills 99.9% Germs', '1950.00', NULL, '358.00', '273.00', 1, '2020-09-02 19:53:09', '2020-09-02 19:53:09', NULL),
(2632, 22, 0, 1, '2631', 'Surf Excel Quick Wash Detergent Powder.', '2.00', 'Surf Excel Quick Wash detergent powder, a one-stop solution for all your laundry woes. While learning new skills and having fun, children often come home with a variety of stains on their clothes and more so often on their very important uniforms. While youre happy that they have these new experiences, the stains leave you worried. To fight these difficult stains you end up putting in a lot extra effort and use additional stain removers such as bleach, lemon etc. Its time you switch to this detergent powder and say goodbye to long laundry drills and juggling with different stain removal products each day. It is one of the premium most detergent powders available in India and has X-Tra Clean particles that combine the power of different stain removing products such as lemon and bleach. The superior technology of Surf Excel Quick Wash removes a variety of common tough stains like oil, ketchup, chocolate, curry stains, tea etc. With X-tra cleaning particles, it makes for the perfect wash.', '370.00', '342.00', 1, '2020-09-02 19:58:47', '2020-09-10 21:55:34', NULL),
(2633, 22, 0, 4, '2632', 'Scotch brite Scrub Pad', '2.00', 'Say Goodbye to your ordinary Scrub Pad. Here is the new & improved Scotch-Brite Scrub Pad which cleans better & lasts longer. Whether your sink is stacked with greasy utensils or plates, the Scotch-Brite Scrub Pad works harder to keep them sparkling clean. Scotch-Brite Scrub Pad comes with superior stain cutters technology which has the power to cut through tough stains and longer than any ordinary scrub pad.( Actual results may vary.)', '15.00', '15.00', 1, '2020-09-02 20:02:37', '2020-09-02 20:02:37', NULL),
(2634, 22, 0, 4, '2633', 'Mangaldeep Sandal Agarbatti Sticks', '82.00', 'The finest Sandal Agarbattis from Mangaldeep brand for your daily puja. Its delightful fragrance makes every prayer a special experience. It dispels your worries and helps you have an undisturbed conversation with God. Be one with God. With Mangaldeep Agarbattis.These are premium quality agarbattis.', '50.00', '50.00', 1, '2020-09-02 20:05:02', '2020-09-02 20:05:02', NULL),
(2635, 22, 0, 2, '2634', 'Comfort Fabric Conditioner  - After Wash', '2.00', 'Want your clothes to shine like new every day. Even if you use the best detergents, repeated washing can tangle cloth fibers, making them rough, dull and lifeless. Taking a small step of comfort after wash fabric conditioner nourishes the cloth fibers, damaged by the detergent, giving them new like shine even after repeated washing. Not only shine, our range of fabric softeners gives visible softness to your favourite clothes while also delivering a long-lasting freshness. To use it for bucket wash: After washing your clothes with laundry detergent, pour half a cap of comfort in a bucket of water, and soak your clothes for 5 mins. Remove and dry them. Dont rinse the clothes again. To use it for semi-automatic wash: Wash your clothes with detergent as usual. Pour 1 cap of comfort in machine tub in clean water during the last rinse cycle. To use it for top load wash: If your machine has a softener compartment, pour 1 cap of comfort at the start of the wash cycle. Otherwise, pour 1 cap of', '415.00', '375.00', 1, '2020-09-02 20:07:11', '2020-09-02 20:07:11', NULL),
(2636, 22, 0, 3, '2635', 'Exo Dishwash Bar - Anti-Bacterial, Round', '700.00', 'Exo Dish Shine Round makes your vessels odorous and removes stain. The fast action formula with the hyper-cleaning technology quickly removes the toughest of stains and makes your vessels shine like never before. This dish washing bar does not leave traces on the vessel and hence it can be easily washed. It works hard on grease and stains, keeping your utensils fresh and shining. It contains many anti-microbial agents that keep your vessels away from dirt and microbes which do not create pealing or itching of your skin.', '67.00', '55.00', 1, '2020-09-02 20:14:15', '2020-09-02 20:14:15', NULL),
(2637, 22, 0, 3, '2636', 'Tide Naturals Washing Detergent Powder - Lemon & Chandan', '800.00', NULL, '58.00', '54.00', 1, '2020-09-02 20:17:36', '2020-09-02 20:17:36', NULL),
(2638, 22, 0, 4, '2637', 'Home Lite Matchbox - Big', '1.00', 'Homelite Matchbox Big is specialized in providing safety wax match box that are of greater quality. The sticks of this match box burns with one strike with no any sparkle. It is one of the most main things in the family. Counting the number of times matches are used would be a waste of breath. This are additional long match sticks lasts longer that allow less loss of match sticks as they last longer.', '10.00', '10.00', 1, '2020-09-02 20:21:13', '2020-09-02 20:21:13', NULL),
(2639, 22, 0, 2, '2638', 'Harpic Bathroom Cleaner - Floral', '1.00', 'Harpic bathroom cleaner is a strong bathroom disinfectant and cleaning liquid that helps remove the toughest of stains. It gives you unbeatable cleaning on greasy soil and particulate matter and the fresh fragrance for the whole bathroom. It has a thick liquid formula with powerful cleaning agents that lift and remove tough stains from almost all bathroom surfaces and kills 99.9% of germs to give you a disinfected and clean bathroom. Harpic bathroom cleaner can be used as a tile cleaner, basin cleaner or even for floor cleaning in the bathroom area. It also gives your bathroom a pleasant fresh fragrance that is available in two variants - lemon or floral. Harpic bathroom cleaner is safe to be used on most bathroom surfaces including tiles, taps, tubs & shower panels, ceramic surfaces, stainless steel and granite surfaces. Do not use it on aluminium, brass and copper. Always spot check on a small, hidden area before using.', '172.00', '141.00', 1, '2020-09-02 20:23:05', '2020-09-02 20:23:05', NULL),
(2640, 22, 0, 3, '2639', 'Tide Plus Detergent Washing Powder - Extra Power Lemon & Mint', '500.00', 'New Tide + with Extra Power detergent, now with the added Power of Bar, has been developed to bring you brilliant whiteness on your clothes. It removes dirt even from washed clothes to give you even better cleaning. The enzyme formula in the washing powder helps in washing away the toughest stains on the clothes, thus making them look bright and fresh. Kids often soil their clothes, especially school uniforms, with tough-to-remove stains and dirt. Tide + with Extra Power is a fine detergent powder which dissolves easily in water and quickly generates foam. The superior formulation can remove dirt even from difficult-to-clean areas like collars and cuffs, and leaves behind a wonderful fragrance. The product works on both white and colored clothes. Extra Power refers to vs previous Tide Plus. Tide, a unit of Procter & Gamble, is the Worlds Oldest & Most Trusted Detergent brand and is the Market Leader in 23 Countries around the world.', '53.00', '49.00', 1, '2020-09-02 20:25:44', '2020-09-02 20:25:44', NULL),
(2641, 22, 0, 5, '2640', 'Dettol After Wash Liquid Laundry Sanitizer - Spring Blossom,', '480.00', 'Keeping your laundry clean and germ-free every day requires a lot of pain and effort but Dettol Laundry Sanitizer makes hygienically cleaning your clothes an easy task by killing 99.99% germs. This clothes sanitizer eliminates bacteria that breed on synthetic fabrics and keep increasing from the excessive oil present in human skin. These are illness-causing germs and should be removed for a healthy and safe living. The clothes conditioner is gentle on clothes and freshens them with a delightful Spring Blossom fragrance. Use it as a winter clothes sanitizer to kill germs and give your family the trusted protection of Dettol. The laundry liquid sanitizer is recommended by the Indian Medical Association (IMA).\r\n\r\nDettol has a wide range of products to protect your family against germs. Explore other products from Dettol: Handwash, Hand Sanitizer, Soaps, Bodywash, Antiseptic Liquid, Disinfectant Cleaner, Disinfectant Spray, Anti-pollution Mask and Laundry Sanitizer.', '170.00', '170.00', 1, '2020-09-02 20:32:54', '2020-09-02 20:32:54', NULL),
(2642, 22, 0, 1, '2641', 'Surf Excel Detergent Powder - Matic, Front Load, 4 kg Get 2 kg Free', '6.00', 'Presenting Surf Excel Matic front load, the machine specialist laundry detergent, from the Surf excel Matic family that gives you 100% tough stain removal in machines. Surf excel matic front load is specially designed to work in high water level environment (20 liters) of front load washing machines. Its low suds formula ensures that it produces the right amount of foam that protects your machine from the effects of excessive foaming. Its hand rub action power penetrates clothes and removes tough stains in the washing machine itself. This means no more soaking or scrubbing and you can save up the time and effort you put behind everyday laundry.', '1099.00', '899.00', 1, '2020-09-02 20:35:02', '2020-09-02 20:35:02', NULL),
(2643, 22, 0, 5, '2642', 'Pril Dishwash Liquid, 6X120 ml Multipack', '720.00', 'Pril Liquid has a unique formula making it non messy and gentle to the skin, thus leaving both your dishes as well as your hands clean, smooth and pleasant. Pril Liquid continues to be a heavyweight in the dish-washing segment in India, providing unparalleled protection and flawless results.', '120.00', '120.00', 1, '2020-09-02 20:38:16', '2020-09-02 20:38:16', NULL),
(2644, 22, 0, 5, '2643', 'All Out Ultra Power+ Slider - Single Refill', '45.00', 'When used with All Out Ultra Power+ Slider machine: Kills Dengue mosquitoes Gives 100% More Power* with Control Slider for intensity adjustment Full room coverage', '72.00', '67.00', 1, '2020-09-02 20:40:20', '2020-09-02 20:40:20', NULL),
(2645, 22, 0, 1, '2644', 'Rin Detergent Powder', '2.00', 'Presenting new Rin Powder - with the promise of whiter and brighter clothes so that you can dress to progress! As you stride forward on your journey through life, Rin gives you the confidence to shine, all day, every day. With its superior technology, this detergent powder brightens your whites and coloured clothes. Rin detergent powder breathes life back into your whites and coloured clothes so that they shine like new. It dissolves quickly in water, targets and gets rid of the toughest of dirt without leaving any residue on your fabrics. It also has a fragrance which ensures your clothes smell fresh and make you feel refreshed all day. With Rin by your side, let your confidence shine as bright as your clothes do! Rin detergent powder works equally well for bucket wash and machine wash, to give you the brightest results.\r\n\r\nAvailable in different pack sizes, Rin detergent powder is here to help you achieve the all-around cleanliness your clothes need!', '168.00', '168.00', 1, '2020-09-02 20:42:56', '2020-09-02 20:42:56', NULL),
(2646, 22, 0, 5, '2645', 'Pril Dishwash Liquid - Active 2X Lime', '425.00', 'It\'s Powerful Active 2x Molecules, Cut away Tough Grease Residue, Remove Food Smell, Leave Utensils Sparkling Clean', '98.00', '92.00', 1, '2020-09-02 20:46:01', '2020-09-02 20:46:01', NULL),
(2647, 22, 0, 4, '2646', 'Mangaldeep 5-In-1 Agarbatti Sticks', '84.00', 'A unique pack with 5 fragrances from Mangaldeep. It contains fragrances of Sandal, Jasmine, Bouquet, Amalum and Aeon so that your every prayer is a special experience. Its delightful fragrance makes every prayer a special experience. It dispels your worries and helps you have an undisturbed conversation with God. The fragrance spreads throughout the room and creates an auspicious environment. Start your day with Mangaldeep Puja Agarbattis. These are premium quality agarbattis.', '50.00', '50.00', 1, '2020-09-02 20:49:45', '2020-09-02 20:49:45', NULL),
(2648, 22, 0, 5, '2647', 'All Out Ultra - Power + Slider', '45.00', 'All Out Ultra Power slider with Original Fragrance kills dengue mosquitoes. This is a combo pack of an Allout Machine and it\'s Refill. It has 100% more power with Control Slider for intensity adjustment Power+ technology for a full room coverage. Thermal Sensor to prevent over-heating.', '89.00', '89.00', 1, '2020-09-02 21:31:39', '2020-09-02 21:31:39', NULL),
(2649, 22, 0, 5, '2648', 'Lizol Kitchen Cleaner - Power, Trigger', '450.00', 'Lizol Power Kitchen Cleaner Trigger removes 99.9% germs, grease, baked on food, food stains, dirt and grime. They are suitable for food contact surfaces which are non-porous and kills bacteria like E.Coli, Salmonella, Staph, Pseudomonas Aeruginosa, etc. on hard non-porous surfaces. It has a clean and fresh scent and no harsh chemical residue.', '136.00', '115.00', 1, '2020-09-02 21:34:58', '2020-09-02 21:34:58', NULL),
(2650, 22, 0, 5, '2649', 'Comfort Perfume Deluxe - Royale Fabric Conditioner', '850.00', 'Comfort Perfume Deluxe Royale 850 ml is an extraordinary blend of floral and oriental notes. Charm everyone around you with this fine French Fragrance. With its top notes of rose and citrus, heart note of lush florals and base notes of velvety vanilla and warm woods, Comfort Perfume Deluxe Royale is a perfect embodiment of Elegance and Royalty. Each of these fragrances has been specially crafted in partnership with world-renowned perfumers and inspired by the latest trends in fine fragrance. Currently available in three fragrances: Royale, Desire and Glamour.', '245.00', '220.00', 1, '2020-09-02 22:05:29', '2020-09-02 22:05:29', NULL);
