(2706, 10, 0, 3, '2705', 'Everest Sambhar Masala', '50.00', 'Sambhar is a wonder recipe from the South of India and can be aptly described as a \'designer health food\'. The various dals, vegatables, spices and condiments that go into a typical Sambhar gives all the nutrients the body needs. Sambhar can be had with rice as a South Indian does it almost everyday, or with Idlis, Wadas, Potato Wadas etc. Sambhar, especially with Idlis has gained universal acceptance in India, and is considered as an excellent diet food.\r\n\r\nUsage:Even in South India, Sambhar is prepared differently from region to region. This Everest blend is suited to all the various Sambhar preparations.', '34.00', '30.00', 1, '2020-09-04 20:52:45', '2020-09-04 20:52:45', NULL),
