(2771, 12, 0, 5, '2770', 'Nyle Naturals Anti-Hairfall Shampoo', '800.00', 'The Nutrition-Boost Complex in our Hairfall Defence Shampoo combines with the goodness of Badam, Amla and Coconut milk to treat hair with gentle care. It naturally fights all three types of hair fall that damage hair on a daily basis - weak roots, breakage in the middle and split ends. Badam is rich in Vitamin E that protects your hair against breakage. Amla has minerals that strengthen your hair thereby preventing split ends. Coconut milk contains proteins that help prevent hair fall from the root.', '305.00', '244.00', 1, '2020-09-08 22:10:44', '2020-09-08 22:10:44', NULL);
