(2888, 14, 0, 3, '2887', 'Nescafe classic coffee', '25.00', 'To take your coffee experiences of the next level,Nescafe,the words favourite instant coffee brand, brings forth a rich and aromatic coffee in the form of nescafe classic .The  unmistakable flavour of nescafe classic is what makes this signature coffe so loved all over the world. Start your day right with the first sip of the clssic 100% pure coffee let the intense taste and wondreful refreshing aroma of nescafe instant coffee awaken your senses to new opportunities. With over 75 years of experience and working with coffee farmers, to help them grow more sustainable coffee through improved crop techniques, we deliver the best coffee produced by the best selecting, roasting and blending methods. Usage: Simply follow the instructions on the back of the pack and mix the coffee powder with hot water or milk to get your own cup of premium instant coffee right at home. The fine coffee powder creates rich, frothy instant coffee that will make a coffee lover smile with sheer delight. Storage r', '75.00', '70.00', 1, '2020-09-16 19:17:29', '2020-09-16 19:17:29', NULL),
