(2892, 14, 0, 3, '2891', 'Complan Pista Badam Refill Pack', '500.00', 'The best ever Complan formula offers balanced nutrition for growing kids to help bridge the nutritional gap that obstructs their regular growth. It is clinically proven to promote 2x faster growth. Complan makes up a deliciously creamy yet nourishing drink with 100% protein from milk. One glass of Complan provides protein equivalent to that of two glasses of milk. It contains 34 vital nutrients like Calcium and Iron which helps children gain the right height and weight, supports brain development and helps maintaining fluid balance in the body. Pro Immunity nutrients in Complan also support immune functions to keep children away from common infections like common cold and related cough and fever. Serve Complan two times as a part of their daily balanced diet and help your children not just grow tall, but stand tall.', '315.00', '290.00', 1, '2020-09-16 20:29:34', '2020-09-18 18:36:49', NULL),
